  { :sdtm_category_id => '14', :cdisc_preferred_term => 'CAPSULE, EXTENDED RELEASE', :synonyms => '', :definition => 'A solid dosage form in which the drug is enclosed within either a hard or soft soluble container made from a suitable form of gelatin, and which releases a drug (or drugs) in such a manner to allow a reduction in dosing frequency as compared to that drug (or drugs) presented as a conventional dosage form. (NCI)', :code => 'C42916', :nci_preferred_term => 'Extended Release Capsule Dosage Form', :read_only => 'true', :id => '351', :submission_value => 'CAPSULE, EXTENDED RELEASE' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'CAPSULE, FILM COATED, EXTENDED RELEASE', :synonyms => '', :definition => 'A solid dosage form in which the drug is enclosed within either a hard or soft soluble container or "shell" made from a suitable form of gelatin; additionally, the capsule is covered in a designated film coating, and which releases a drug (or drugs) in such a manner to allow at least a reduction in dosing frequency as compared to that drug (or drugs) presented as a conventional dosage form. (NCI)', :code => 'C42928', :nci_preferred_term => 'Extended Release Film Coated Capsule Dosage Form', :read_only => 'true', :id => '352', :submission_value => 'CAPSULE, FILM COATED, EXTENDED RELEASE' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'CAPSULE, GELATIN COATED', :synonyms => '', :definition => 'A solid dosage form in which the drug is enclosed within either a hard or soft soluble container made from a suitable form of gelatin; through a banding process, the capsule is coated with additional layers of gelatin so as to form a complete seal. (NCI)', :code => 'C42936', :nci_preferred_term => 'Gelatin Coated Capsule Dosage Form', :read_only => 'true', :id => '353', :submission_value => 'CAPSULE, GELATIN COATED' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'CAPSULE, LIQUID FILLED', :synonyms => '', :definition => 'A solid dosage form in which the drug is enclosed within a soluble, gelatin shell which is plasticized by the addition of a polyol, such as sorbitol or glycerin, and is therefore of a somewhat thicker consistency than that of a hard shell capsule; typically, the active ingredients are dissolved or suspended in a liquid vehicle. (NCI)', :code => 'C42954', :nci_preferred_term => 'Liquid Filled Capsule Dosage Form', :read_only => 'true', :id => '354', :submission_value => 'CAPSULE, LIQUID FILLED' },
