  { :sdtm_category_id => '14', :cdisc_preferred_term => 'CIGARETTE', :synonyms => '', :definition => 'A narrow tube filled with material that is capable to burn with release of therapeutically-active substance(s) during the process of smoking. Cigarette is a very efficient drug-delivery inhaler system for fast-acting substances.(FDA)', :code => 'C42678', :nci_preferred_term => 'Cigarette Dosage Form', :read_only => 'true', :id => '356', :submission_value => 'CIGARETTE' },
