  { :sdtm_category_id => '14', :cdisc_preferred_term => 'CONCENTRATE', :synonyms => '', :definition => 'A liquid preparation of increased strength and reduced volume which is usually diluted prior to administration. (NCI)', :code => 'C60891', :nci_preferred_term => 'Concentrate Dosage Form', :read_only => 'true', :id => '358', :submission_value => 'CONCENTRATE' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'CONE', :synonyms => '', :definition => 'A solid dosage form bounded by a circular base and the surface formed by line segments joining every point of the boundary of the base to a common vertex. A cone (usually containing antibiotics) is normally placed below the gingiva after a dental extraction. (NCI)', :code => 'C42900', :nci_preferred_term => 'Cone Dosage Form', :read_only => 'true', :id => '359', :submission_value => 'CONE' },
