  { :sdtm_category_id => '14', :cdisc_preferred_term => 'CREAM', :synonyms => '', :definition => 'A semisolid emulsion of either the oil-in-water or the water-in-oil type, ordinarily intended for topical use. (NCI)', :code => 'C28944', :nci_preferred_term => 'Cream Dosage Form', :read_only => 'true', :id => '361', :submission_value => 'CREAM' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'CREAM, AUGMENTED', :synonyms => '', :definition => 'A cream dosage form that enhances drug delivery. Augmentation does not refer to the strength of the drug in the dosage form. NOTE: CDER has decided to refrain from expanding the use of this dosage form due to difficulties in setting specific criteria that must be met to be considered augmented. (FDA)', :code => 'C60897', :nci_preferred_term => 'Augmented Cream Dosage Form', :read_only => 'true', :id => '362', :submission_value => 'CREAM, AUGMENTED' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'CRYSTAL', :synonyms => '', :definition => 'A naturally produced angular solid of definite form in which the ultimate units from which it is built up are systematically arranged; they are usually evenly spaced on a regular space lattice.', :code => 'C42901', :nci_preferred_term => 'Crystal Dosage Form', :read_only => 'true', :id => '363', :submission_value => 'CRYSTAL' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'CULTURE', :synonyms => '', :definition => 'The propagation of microorganisms or of living tissue cells in special media conducive to their growth. (NCI)', :code => 'C45415', :nci_preferred_term => 'Culture Dosage Form', :read_only => 'true', :id => '364', :submission_value => 'CULTURE' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'DIAPHRAGM', :synonyms => '', :definition => 'A device usually dome-shaped, worn during copulation over the cervical mouth for prevention of conception or infection. (NCI)', :code => 'C47890', :nci_preferred_term => 'Diaphragm Dosage Form', :read_only => 'true', :id => '365', :submission_value => 'DIAPHRAGM' },
