  { :sdtm_category_id => '14', :cdisc_preferred_term => 'DOUCHE', :synonyms => '', :definition => 'A liquid preparation, intended for the irrigative cleansing of the vagina, that is prepared from powders, liquid solutions, or liquid concentrates and contains one or more chemical substances dissolved in a suitable solvent or mutually miscible solvents. (NCI)', :code => 'C42679', :nci_preferred_term => 'Douche Dosage Form', :read_only => 'true', :id => '367', :submission_value => 'DOUCHE' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'DRESSING', :synonyms => '', :definition => 'The application of various materials for protecting a wound.(FDA)', :code => 'C42763', :nci_preferred_term => 'Dressing Dosage Form', :read_only => 'true', :id => '368', :submission_value => 'DRESSING' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'DRUG DELIVERY SYSTEM', :synonyms => '', :definition => 'Modern technology, distributed with or as a part of a drug product that allows for the uniform release or targeting of drugs to the body. (FDA)', :code => 'C17423', :nci_preferred_term => 'Drug Delivery System', :read_only => 'true', :id => '369', :submission_value => 'DRUG DELIVERY SYSTEM' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'ELIXIR', :synonyms => '', :definition => 'A clear, pleasantly flavored, sweetened hydroalcoholic liquid containing dissolved medicinal agents; it is intended for oral use. (NCI)', :code => 'C42912', :nci_preferred_term => 'Elixir Dosage Form', :read_only => 'true', :id => '370', :submission_value => 'ELIXIR' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'EMULSION', :synonyms => '', :definition => 'A dosage form consisting of a two-phase system comprised of at least two immiscible liquids (1), one of which is dispersed as droplets (internal or dispersed phase) within the other liquid (external or continuous phase), generally stabilized with one or more emulsifying agents. Note 1: A liquid is pourable; it flows and conforms to its container at room temperature. It displays Newtonian or pseudoplastic flow behavior. Note 2: Emulsion is used as a dosage form term unless a more specific term is applicable, e.g. cream, lotion, ointment. (NCI)', :code => 'C42913', :nci_preferred_term => 'Emulsion Dosage Form', :read_only => 'true', :id => '371', :submission_value => 'EMULSION' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'ENEMA', :synonyms => '', :definition => 'A rectal preparation for therapeutic, diagnostic, or nutritive purposes. (NCI)', :code => 'C42915', :nci_preferred_term => 'Enema Dosage Form', :read_only => 'true', :id => '372', :submission_value => 'ENEMA' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'EXTRACT', :synonyms => '', :definition => 'A concentrated preparation of vegetable or animal drugs obtained by removal of the active constituents of the respective drugs with a suitable menstrua, evaporation of all or nearly all of the solvent, and adjustment of the residual masses or powders to the prescribed standards. (NCI)', :code => 'C42929', :nci_preferred_term => 'Extract Dosage Form', :read_only => 'true', :id => '373', :submission_value => 'EXTRACT' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'FIBER, EXTENDED RELEASE', :synonyms => '', :definition => 'A slender and elongated solid thread-like substance that delivers drug in such a manner to allow a reduction in dosing frequency as compared to that drug (or drugs) presented as a conventional dosage form. (FDA)', :code => 'C60926', :nci_preferred_term => 'Extended Release Fiber Dosage Form', :read_only => 'true', :id => '374', :submission_value => 'FIBER, EXTENDED RELEASE' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'FILM', :synonyms => '', :definition => 'A thin layer or coating. (NCI)', :code => 'C42932', :nci_preferred_term => 'Film Dosage Form', :read_only => 'true', :id => '375', :submission_value => 'FILM' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'FILM, EXTENDED RELEASE', :synonyms => '', :definition => 'A drug delivery system in the form of a film that releases the drug over an extended period in such a way as to maintain constant drug levels in the blood or target tissue. (NCI)', :code => 'C42920', :nci_preferred_term => 'Extended Release Film Dosage Form', :read_only => 'true', :id => '376', :submission_value => 'FILM, EXTENDED RELEASE' },
