  { :sdtm_category_id => '14', :cdisc_preferred_term => 'FOR SOLUTION', :synonyms => '', :definition => 'A product, usually a solid, intended for solution prior to administration. (FDA)', :code => 'C60927', :nci_preferred_term => 'Dosage Form For Solution', :read_only => 'true', :id => '378', :submission_value => 'FOR SOLUTION' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'FOR SUSPENSION', :synonyms => '', :definition => 'A product, usually a solid, intended for suspension prior to administration. (FDA)', :code => 'C60928', :nci_preferred_term => 'Dosage Form For Suspension', :read_only => 'true', :id => '379', :submission_value => 'FOR SUSPENSION' },
