  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GAS', :synonyms => '', :definition => 'Any elastic aeriform fluid in which the molecules are separated from one another and have free paths. (NCI)', :code => 'C42933', :nci_preferred_term => 'Gas Dosage Form', :read_only => 'true', :id => '381', :submission_value => 'GAS' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GEL', :synonyms => '', :definition => 'A semisolid (1) dosage form that contains a gelling agent to provide stiffness to a solution or a colloidal dispersion (2). A gel may contain suspended particles. Note 1: A semisolid is not pourable; it does not flow or conform to its container at room temperature. It does not flow at low shear stress and generally exhibits plastic flow behavior. Note 2: A colloidal dispersion is a system in which particles of colloidal dimension (i.e., typically between 1 nm and 1 micrometer) are distributed uniformly throughout a liquid. (NCI)', :code => 'C42934', :nci_preferred_term => 'Gel Dosage Form', :read_only => 'true', :id => '382', :submission_value => 'GEL' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GEL, DENTIFRICE', :synonyms => '', :definition => 'A combination of a dentifrice (formulation intended to clean and/or polish the teeth, and which may contain certain additional agents), and a gel. It is used with a toothbrush for the purpose of cleaning and polishing the teeth. (NCI)', :code => 'C42906', :nci_preferred_term => 'Dentifrice Gel Dosage Form', :read_only => 'true', :id => '383', :submission_value => 'GEL, DENTIFRICE' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GEL, METERED', :synonyms => '', :definition => 'A gel preparation, with metered dose valves, which allow for the delivery of a uniform quantity of gel upon each activation. (FDA)', :code => 'C60930', :nci_preferred_term => 'Metered Gel Dosage Form', :read_only => 'true', :id => '384', :submission_value => 'GEL, METERED' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GENERATOR', :synonyms => '', :definition => 'An apparatus for the formation of vapor or gas from a liquid or solid by heat or chemical action. The term GENERATOR also applies to radioactive columns from which radionuclides are provided. (NCI)', :code => 'C48193', :nci_preferred_term => 'Generator Dosage Form', :read_only => 'true', :id => '385', :submission_value => 'GENERATOR' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GLOBULE', :synonyms => '', :definition => 'Also called pellets or pilules, are made of pure sucrose, lactose, or other polysaccharides. They are formed into small globular masses of various sizes, and are medicated by placing them in a vial and adding the liquid drug attenuation in the proportion not less than one percent (v/w). After shaking, the medicated globules are dried at temperatures not to exceed 40 degrees Centigrade. (NCI)', :code => 'C42937', :nci_preferred_term => 'Globule Dosage Form', :read_only => 'true', :id => '386', :submission_value => 'GLOBULE' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GRAFT', :synonyms => '', :definition => 'A slip of skin or of other tissue for implantation. (NCI)', :code => 'C45416', :nci_preferred_term => 'Graft Dosage Form', :read_only => 'true', :id => '387', :submission_value => 'GRAFT' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GRANULE', :synonyms => '', :definition => 'A small particle or grain. (NCI)', :code => 'C42938', :nci_preferred_term => 'Granule Dosage Form', :read_only => 'true', :id => '388', :submission_value => 'GRANULE' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GRANULE, DELAYED RELEASE', :synonyms => '', :definition => 'A small medicinal particle or grain to which an enteric or other coating has been applied, thus delaying release of the drug until its passage into the intestines. (NCI)', :code => 'C42903', :nci_preferred_term => 'Delayed Release Granule Dosage Form', :read_only => 'true', :id => '389', :submission_value => 'GRANULE, DELAYED RELEASE' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GRANULE, EFFERVESCENT', :synonyms => '', :definition => 'A small particle or grain containing a medicinal agent in a dry mixture usually composed of sodium bicarbonate, citric acid, and tartaric acid which, when in contact with water, has the capability to release gas, resulting in effervescence. (NCI)', :code => 'C42909', :nci_preferred_term => 'Effervescent Granule Dosage Form', :read_only => 'true', :id => '390', :submission_value => 'GRANULE, EFFERVESCENT' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GRANULE, FOR SOLUTION', :synonyms => '', :definition => 'A small medicinal particle or grain made available in its more stable dry form, to be reconstituted with solvent just before dispensing; the granules are so prepared to contain not only the medicinal agent, but the colorants, flavorants, and any other desired pharmaceutic ingredient. (NCI)', :code => 'C42939', :nci_preferred_term => 'Granule For Solution Dosage Form', :read_only => 'true', :id => '391', :submission_value => 'GRANULE, FOR SOLUTION' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GRANULE, FOR SUSPENSION', :synonyms => '', :definition => 'A small medicinal particle or grain made available in its more stable dry form, to be reconstituted with solvent just before dispensing to form a suspension; the granules are so prepared to contain not only the medicinal agent, but the colorants, flavorants, and any other desired pharmaceutic ingredient. (NCI)', :code => 'C42940', :nci_preferred_term => 'Granule For Suspension Dosage Form', :read_only => 'true', :id => '392', :submission_value => 'GRANULE, FOR SUSPENSION' },
