  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GUM', :synonyms => '', :definition => 'A mucilaginous excretion from various plants. (NCI)', :code => 'C42941', :nci_preferred_term => 'Gum Dosage Form', :read_only => 'true', :id => '394', :submission_value => 'GUM' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GUM, CHEWING', :synonyms => '', :definition => 'A sweetened and flavored insoluble plastic material of various shapes which when chewed, releases a drug substance into the oral cavity. (NCI)', :code => 'C42894', :nci_preferred_term => 'Chewing Gum Dosage Form', :read_only => 'true', :id => '395', :submission_value => 'GUM, CHEWING' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'GUM, RESIN', :synonyms => '', :definition => 'Natural mixture of gum and resin, usually obtained as exudations from plants. (NCI)', :code => 'C42978', :nci_preferred_term => 'Resin Gum Dosage Form', :read_only => 'true', :id => '396', :submission_value => 'GUM, RESIN' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'IMPLANT', :synonyms => '', :definition => 'A material containing drug intended to be inserted securely and deeply in a living site for growth, slow release, or formation of an organic union. (NCI)', :code => 'C42942', :nci_preferred_term => 'Implant Dosage Form', :read_only => 'true', :id => '397', :submission_value => 'IMPLANT' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'INHALANT', :synonyms => '', :definition => 'A special class of inhalations consisting of a drug or combination of drugs, that by virtue of their high vapor pressure, can be carried by an air current into the nasal passage where they exert their effect; the container from which the inhalant generally is administered is known as an inhaler. (NCI)', :code => 'C42944', :nci_preferred_term => 'Inhalant Dosage Form', :read_only => 'true', :id => '398', :submission_value => 'INHALANT' },
