  { :sdtm_category_id => '14', :cdisc_preferred_term => 'INJECTION', :synonyms => '', :definition => 'A sterile preparation intended for parenteral use; five distinct classes of injections exist as defined by the USP. (NCI)', :code => 'C42946', :nci_preferred_term => 'Injectable Dosage Form', :read_only => 'true', :id => '400', :submission_value => 'INJECTION' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'INJECTION, EMULSION', :synonyms => '', :definition => 'An emulsion consisting of a sterile, pyrogen-free preparation intended to be administered parenterally.(FDA)', :code => 'C42914', :nci_preferred_term => 'Emulsion for Injection Dosage Form', :read_only => 'true', :id => '401', :submission_value => 'INJECTION, EMULSION' },
  { :sdtm_category_id => '14', :cdisc_preferred_term => 'INJECTION, LIPID COMPLEX', :synonyms => '', :definition => '[definition pending](FDA)', :code => 'C42950', :nci_preferred_term => 'Injectable Lipid Complex Dosage Form', :read_only => 'true', :id => '402', :submission_value => 'INJECTION, LIPID COMPLEX' },
