  { :sdtm_category_id => '23', :cdisc_preferred_term => 'DOUBLE BLIND', :synonyms => '', :definition => 'A study in which neither the subject nor the investigator nor the research team interacting with the subject or data during the trial knows what treatment a subject is receiving. (CDISC glossary)', :code => 'C15228', :nci_preferred_term => 'Double Blind Study', :read_only => 'true', :id => '702', :submission_value => 'DOUBLE BLIND' },
  { :sdtm_category_id => '23', :cdisc_preferred_term => 'OPEN LABEL', :synonyms => '', :definition => 'A trial in which subjects and investigators know which product each subject is receiving; opposite of a blinded or double-blind study. (CDISC glossary)', :code => 'C49659', :nci_preferred_term => 'Open Label Study', :read_only => 'true', :id => '703', :submission_value => 'OPEN LABEL' },
  { :sdtm_category_id => '23', :cdisc_preferred_term => 'SINGLE BLIND', :synonyms => '', :definition => 'A study in which one party, either the investigator or the subject, does not know which medication or placebo is administered to the subject; also called singlemasked study. (CDISC glossary)', :code => 'C28233', :nci_preferred_term => 'Single Blind Study', :read_only => 'true', :id => '704', :submission_value => 'SINGLE BLIND' },
