  { :sdtm_category_id => '25', :cdisc_preferred_term => 'Phase I Trial', :synonyms => 'Trial Phase 1; 1', :definition => 'The initial introduction of an investigational new drug into humans. Phase 1 studies are typically closely monitored and may be conducted in patients or normal volunteer subjects. NOTE: These studies are designed to determine the metabolism and pharmacologic actions of the drug in humans, the side effects associated with increasing doses, and, if possible, to gain early evidence on effectiveness. During Phase 1, sufficient information about the drug\'s pharmacokinetics and pharmacological effects should be obtained to permit the design of well-controlled, scientifically valid, Phase 2 studies. The total number of subjects and patients included in Phase I studies varies with the drug, but is generally in the range of 20 to 80. Phase 1 studies also include studies of drug metabolism, structure-activity relationships, and mechanism of action in humans, as well as studies in which investigational drugs are used as research tools to explore biological phenomena or disease processes. [After FDA CDER Handbook, ICH E8] (CDISC glossary)', :code => 'C15600', :nci_preferred_term => 'Phase I Trial', :read_only => 'true', :id => '712', :submission_value => 'Phase I Trial' },
  { :sdtm_category_id => '25', :cdisc_preferred_term => 'Phase I/II Trial', :synonyms => 'Trial Phase 1-2; 1-2', :definition => 'A class of clinical study that combines elements characteristic of traditional Phase I and Phase II trials. See also Phase I, Phase II.', :code => 'C15693', :nci_preferred_term => 'Phase I/II Trial', :read_only => 'true', :id => '713', :submission_value => 'Phase I/II Trial' },
  { :sdtm_category_id => '25', :cdisc_preferred_term => 'Phase II Trial', :synonyms => 'Trial Phase 2; 2', :definition => 'Phase 2. Controlled clinical studies conducted to evaluate the effectiveness of the drug for a particular indication or indications in patients with the disease or condition under study and to determine the common short-term side effects and risks associated with the drug. NOTE: Phase 2 studies are typically well controlled, closely monitored, and conducted in a relatively small number of patients, usually involving no more than several hundred subjects. [After FDA CDER Handbook, ICH E8] (CDISC glossary)', :code => 'C15601', :nci_preferred_term => 'Phase II Trial', :read_only => 'true', :id => '714', :submission_value => 'Phase II Trial' },
  { :sdtm_category_id => '25', :cdisc_preferred_term => 'Phase II/III Trial', :synonyms => 'Trial Phase 2-3; 2-3', :definition => 'A class of clinical study that combines elements characteristic of traditional Phase II and Phase III trials.', :code => 'C15694', :nci_preferred_term => 'Phase II/III Trial', :read_only => 'true', :id => '715', :submission_value => 'Phase II/III Trial' },
  { :sdtm_category_id => '25', :cdisc_preferred_term => 'Phase IIa Trial', :synonyms => 'Trial Phase 2A; 2A', :definition => 'A clinical research protocol generally referred to as a pilot or feasibility trial that aims to prove the concept of the new intervention in question. (NCI)', :code => 'C49686', :nci_preferred_term => 'Phase IIa Trial', :read_only => 'true', :id => '716', :submission_value => 'Phase IIa Trial' },
  { :sdtm_category_id => '25', :cdisc_preferred_term => 'Phase IIb Trial', :synonyms => 'Trial Phase 2B; 2B', :definition => 'A clinical research protocol generally referred to as a well-controlled and pivotal trial that aims to prove the mechanism of action of the new intervention in question. A pivotal study will generally be well-controlled, randomized, of adequate size, and whenever possible, double-blind. (NCI)', :code => 'C49688', :nci_preferred_term => 'Phase IIb Trial', :read_only => 'true', :id => '717', :submission_value => 'Phase IIb Trial' },
  { :sdtm_category_id => '25', :cdisc_preferred_term => 'Phase III Trial', :synonyms => 'Trial Phase 3; 3', :definition => 'Phase 3. Studies are expanded controlled and uncontrolled trials. They are performed after preliminary evidence suggesting effectiveness of the drug has been obtained, and are intended to gather the additional information about effectiveness and safety that is needed to confirm efficacy and evaluate the overall benefit-risk relationship of the drug and to provide an adequate basis for physician labeling. NOTE: Phase 3 studies usually include from several hundred to several thousand subjects. [After FDA CDER Handbook, ICH E8] (CDISC glossary)', :code => 'C15602', :nci_preferred_term => 'Phase III Trial', :read_only => 'true', :id => '718', :submission_value => 'Phase III Trial' },
  { :sdtm_category_id => '25', :cdisc_preferred_term => 'Phase IIIa Trial', :synonyms => 'Trial Phase 3A; 3A', :definition => 'A classification typically assigned retrospectively to a Phase III trial upon determination by regulatory authorities of a need for a Phase III B trial.', :code => 'C49687', :nci_preferred_term => 'Phase IIIa Trial', :read_only => 'true', :id => '719', :submission_value => 'Phase IIIa Trial' },
  { :sdtm_category_id => '25', :cdisc_preferred_term => 'Phase IIIb Trial', :synonyms => 'Trial Phase 3B; 3B', :definition => 'A subcategory of Phase III trials done near the time of approval to elicit additional findings. NOTE: Dossier review may continue while associated Phase IIIB trials are conducted. These trials may be required as a condition of regulatory authority approval.', :code => 'C49689', :nci_preferred_term => 'Phase IIIb Trial', :read_only => 'true', :id => '720', :submission_value => 'Phase IIIb Trial' },
  { :sdtm_category_id => '25', :cdisc_preferred_term => 'Phase IV Trial', :synonyms => 'Trial Phase 4; 4', :definition => 'Phase 4. Postmarketing (Phase 4) studies to delineate additional information about the drug\'s risks, benefits, and optimal use that may be requested by regulatory authorities in conjunction with marketing approval. NOTE: These studies could include, but would not be limited to, studying different doses or schedules of administration than were used in Phase 2 studies, use of the drug in other patient populations or other stages of the disease, or use of the drug over a longer period of time. [After FDA CDER Handbook, ICH E8] (CDISC glossary)', :code => 'C15603', :nci_preferred_term => 'Phase IV Trial', :read_only => 'true', :id => '721', :submission_value => 'Phase IV Trial' },
  { :sdtm_category_id => '25', :cdisc_preferred_term => 'Phase V Trial', :synonyms => 'Trial Phase 5; 5', :definition => 'Postmarketing surveillance is sometimes referred to as Phase V.', :code => 'C47865', :nci_preferred_term => 'Phase V Trial', :read_only => 'true', :id => '722', :submission_value => 'Phase V Trial' },
  { :sdtm_category_id => '25', :cdisc_preferred_term => 'NOT APPLICABLE', :synonyms => 'NA', :definition => 'Determination of a value is not relevant in the current context. (NCI)', :code => 'C48660', :nci_preferred_term => 'Not Applicable', :read_only => 'true', :id => '723', :submission_value => 'NA' },
  { :sdtm_category_id => '26', :cdisc_preferred_term => 'ADDON', :synonyms => 'Added on to Existing Treatments', :definition => 'The addition of a therapeutic product to the existing regimen in a clinical trial, where both entities remain as discrete products.', :code => 'C49703', :nci_preferred_term => 'Test Product Added to Existing Treatment', :read_only => 'true', :id => '725', :submission_value => 'ADDON' },
  { :sdtm_category_id => '26', :cdisc_preferred_term => 'AGEMAX', :synonyms => 'Planned Maximum Age of Subjects', :definition => 'The anticipated maximum age of the subjects to be entered in a clinical trial. (NCI)', :code => 'C49694', :nci_preferred_term => 'Planned Maximum Age of Subjects', :read_only => 'true', :id => '726', :submission_value => 'AGEMAX' }
