  { :sdtm_category_id => '26', :cdisc_preferred_term => 'RANDOM', :synonyms => 'Trial is Randomized', :definition => 'The process of assigning trial subjects to treatment or control groups using an element of chance to determine the assignments in order to reduce bias. NOTE: Unequal randomization is used to allocate subjects into groups at a differential rate; for example, three subjects may be assigned to a treatment group for every one assigned to the control group. [ICH E6 1.48] See also balanced study. (CDISC glossary)', :code => 'C25196', :nci_preferred_term => 'Randomization', :read_only => 'true', :id => '733', :submission_value => 'RANDOM' },
