  { :sdtm_category_id => '26', :cdisc_preferred_term => 'TPHASE', :synonyms => 'Trial Phase Classification', :definition => 'Clinical trials are broken into three or four phases: Phase I tests a new drug or treatment for safety in a small group; Phase II expands the study to a larger group of people; Phase III expands the study to an even larger group of people to measure whether the treatment actually benefits patients, and whether its benefits exceed its risks; and Phase IV takes place after the drug or treatment has been licensed and marketed. (NCI)', :code => 'C48281', :nci_preferred_term => 'Trial Phase', :read_only => 'true', :id => '742', :submission_value => 'TPHASE' },
