  { :sdtm_category_id => '27', :cdisc_preferred_term => 'ADDON', :synonyms => 'Added on to Existing Treatments', :definition => 'The addition of a therapeutic product to the existing regimen in a clinical trial, where both entities remain as discrete products.', :code => 'C49703', :nci_preferred_term => 'Test Product Added to Existing Treatment', :read_only => 'true', :id => '745', :submission_value => 'Added on to Existing Treatments' },
