  { :sdtm_category_id => '27', :cdisc_preferred_term => 'PLANSUB', :synonyms => 'Planned Number of Subjects', :definition => 'The number of subjects entered in a clinical trial. (NCI)', :code => 'C49692', :nci_preferred_term => 'Planned Subject Number', :read_only => 'true', :id => '752', :submission_value => 'Planned Number of Subjects' },
