  { :sdtm_category_id => '27', :cdisc_preferred_term => 'SEXPOP', :synonyms => 'Sex of Participants', :definition => 'The specific sex, either male, female, or mixed of the subject group being studied. (NCI)', :code => 'C49696', :nci_preferred_term => 'Sex of Study Group', :read_only => 'true', :id => '755', :submission_value => 'Sex of Participants' },
