  { :sdtm_category_id => '27', :cdisc_preferred_term => 'TDIGRP', :synonyms => 'Diagnosis Group', :definition => 'A grouping of individuals on the basis of a shared procedure or disease, or lack thereof (e.g. healthy volunteers, type 2 diabetic subjects, subjects with renal cell cancer). Standardized naming systems are available that define the groups within which a subject should be placed. (NCI)', :code => 'C49650', :nci_preferred_term => 'Diagnosis Group', :read_only => 'true', :id => '759', :submission_value => 'Diagnosis Group' },
