  { :sdtm_category_id => '28', :cdisc_preferred_term => 'BIO-AVAILABILITY', :synonyms => '', :definition => 'A study of the degree to which or rate at which a drug or other substance is absorbed or becomes available at the site of physiological activity after administration. (NCI)', :code => 'C49664', :nci_preferred_term => 'Bioavailability Study', :read_only => 'true', :id => '765', :submission_value => 'BIO-AVAILABILITY' },
  { :sdtm_category_id => '28', :cdisc_preferred_term => 'BIO-EQUIVALENCE', :synonyms => '', :definition => 'A study most often used to compare the efficacy of different formulations to treat a given disease. It is the testing of an old versus a new formulation in healthy volunteers or subjects with the disease under study and usually in one dose. (NCI)', :code => 'C49665', :nci_preferred_term => 'Therapeutic Equivalency Study', :read_only => 'true', :id => '766', :submission_value => 'BIO-EQUIVALENCE' },
  { :sdtm_category_id => '28', :cdisc_preferred_term => 'EFFICACY', :synonyms => '', :definition => 'A study of the relative therapeutic efficacy of treatment of a disease. Usually this is a Phase II or III study. (NCI)', :code => 'C49666', :nci_preferred_term => 'Efficacy Study', :read_only => 'true', :id => '767', :submission_value => 'EFFICACY' },
  { :sdtm_category_id => '28', :cdisc_preferred_term => 'PHARMACODYNAMIC', :synonyms => '', :definition => 'A study of the biochemical and physiological effect of a drug and the mechanism of drug action and the relationship between drug concentration and effect. (NCI)', :code => 'C49662', :nci_preferred_term => 'Pharmacodynamic Study', :read_only => 'true', :id => '768', :submission_value => 'PHARMACODYNAMIC' },
  { :sdtm_category_id => '28', :cdisc_preferred_term => 'PHARMACOECONOMIC', :synonyms => '', :definition => 'A study that assesses the value associated with a given drug in therapeutic and economic terms. This type of study is multidisciplinary in nature and takes into consideration the social and economic costs (resource utilization costs including direct, indirect, and intangible costs) of drug therapy in addition to its direct therapeutic benefits. Analyses relate the difference in therapeutic benefits to the difference in costs between treatment alternatives. (NCI)', :code => 'C39493', :nci_preferred_term => 'Pharmacoeconomic Study', :read_only => 'true', :id => '769', :submission_value => 'PHARMACOECONOMIC' },
  { :sdtm_category_id => '28', :cdisc_preferred_term => 'PHARMACOGENOMIC', :synonyms => '', :definition => 'A study of identification and analysis of genomic variations that affect the efficacy of a drug. Pharmacogenomic studies can potentially be predictive of an individual\'s drug-response or adverse reactions or susceptibility to iatrogenic disorders, and may also reveal new targets that can help in the design of new drugs. (NCI)', :code => 'C49661', :nci_preferred_term => 'Pharmacogenomic Study', :read_only => 'true', :id => '770', :submission_value => 'PHARMACOGENOMIC' },
  { :sdtm_category_id => '28', :cdisc_preferred_term => 'PHARMACOKINETIC', :synonyms => '', :definition => 'A study of the process by which a drug is absorbed, distributed, metabolized, and eliminated by the body. (NCI)', :code => 'C49663', :nci_preferred_term => 'Pharmacokinetic Study', :read_only => 'true', :id => '771', :submission_value => 'PHARMACOKINETIC' },
  { :sdtm_category_id => '28', :cdisc_preferred_term => 'SAFETY', :synonyms => '', :definition => 'A study of the relative safety of treatment of a disease. Usually this is a Phase I or II trial. (NCI)', :code => 'C49667', :nci_preferred_term => 'Safety Study', :read_only => 'true', :id => '772', :submission_value => 'SAFETY' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => '%', :synonyms => 'Percentage', :definition => 'A fraction or ratio with 100 understood as the denominator. (NCI)', :code => 'C25613', :nci_preferred_term => 'Percentage', :read_only => 'true', :id => '774', :submission_value => '%' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => 'BEATS/MIN', :synonyms => 'Beats per Minute', :definition => 'The number of heartbeats measured per minute time. (NCI)', :code => 'C49673', :nci_preferred_term => 'Beats per Minute', :read_only => 'true', :id => '775', :submission_value => 'BEATS/MIN' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => 'BREATHS/MIN', :synonyms => 'Breaths per Minute', :definition => 'The number of breaths (inhalation and exhalation) taken per minute time. (NCI)', :code => 'C49674', :nci_preferred_term => 'Breaths per Minute', :read_only => 'true', :id => '776', :submission_value => 'BREATHS/MIN' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => 'C', :synonyms => 'Degree Celsius', :definition => 'A unit of temperature of the temperature scale designed so that the freezing point of water is 0 degrees and the boiling point is 100 degrees at standard atmospheric pressure. The current official definition of the Celsius sets 0.01 C to be at the triple point of water and a degree to be 1/273.16 of the difference in temperature between the triple point of water and absolute zero. One degree Celsius represents the same temperature difference as one Kelvin. (NCI)', :code => 'C42559', :nci_preferred_term => 'Degree Celsius', :read_only => 'true', :id => '777', :submission_value => 'C' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => 'cm', :synonyms => 'Centimeter', :definition => 'A basic unit of length in the former CGS version of metric system, equal to one hundredth of a meter or approximately 0.393 700 787 inch. (NCI)', :code => 'C49668', :nci_preferred_term => 'Centimeter', :read_only => 'true', :id => '778', :submission_value => 'cm' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => 'F', :synonyms => 'Degree Fahrenheit', :definition => 'The Fahrenheit temperature scale is named after the German physicist Gabriel Fahrenheit (1686-1736), who proposed it in 1724. In this scale, the freezing point of water is 32 degrees Fahrenheit and the boiling point is 212 degrees, placing the boiling and melting points of water 180 degrees apart. In this scale a degree Fahrenheit is 5/9ths of a Kelvin (or of a degree Celsius), and minus 40 degrees Fahrenheit is equal to minus 40 degrees Celsius. (NCI)', :code => 'C44277', :nci_preferred_term => 'Degree Fahrenheit', :read_only => 'true', :id => '779', :submission_value => 'F' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => 'g', :synonyms => 'Gram', :definition => 'A metric unit of mass equal to one one thousandth of a kilogram. (NCI)', :code => 'C48155', :nci_preferred_term => 'Gram', :read_only => 'true', :id => '780', :submission_value => 'g' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => 'IN', :synonyms => 'Inch', :definition => 'A traditional unit of length equal to 2.54 centimeters. (NCI)', :code => 'C48500', :nci_preferred_term => 'Inch', :read_only => 'true', :id => '781', :submission_value => 'IN' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => 'kg', :synonyms => 'Kilogram', :definition => 'The basic SI unit of mass. It is defined as the mass of an international prototype in the form of a platinum-iridium cylinder kept at Sevres in France. It is the only basic unit still defined in terms of a material object, and also the only one with a prefix [kilo] already in place. A kilogram is equal to 1,000 grams and 2.204 622 6 pounds. (NCI)', :code => 'C28252', :nci_preferred_term => 'Kilogram', :read_only => 'true', :id => '782', :submission_value => 'kg' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => 'kg/m2', :synonyms => 'Kilogram Per Square Meter', :definition => 'The SI derived unit of spread rate of a substance by mass, used also as a measure of area density. (NCI)', :code => 'C49671', :nci_preferred_term => 'Kilogram Per Square Meter', :read_only => 'true', :id => '783', :submission_value => 'kg/m2' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => 'LB', :synonyms => 'Pound', :definition => 'A traditional unit of mass. By international agreement, one avoirdupois pound is equal to exactly 0.453 592 37 kilogram, 16 ounces, or 1.215 28 troy pounds. (NCI)', :code => 'C48531', :nci_preferred_term => 'Pound', :read_only => 'true', :id => '784', :submission_value => 'LB' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => 'm2', :synonyms => 'Square Meter', :definition => 'The SI unit of area measurement equal to a square whose sides are one meter long. Square meter is equal to 10,000 square centimeters; 0.01 ares; 1.196 square yards; 10.76 square feet; 1550 square inches. (NCI)', :code => 'C42569', :nci_preferred_term => 'Square Meter', :read_only => 'true', :id => '785', :submission_value => 'm2' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => 'mmHg', :synonyms => 'Millimeter of Mercury', :definition => 'A unit of pressure equal to 0.001316 atmosphere and equal to the pressure indicated by one millimeter rise of mercury in a barometer at the Earth\'s surface. (NCI)', :code => 'C49670', :nci_preferred_term => 'Millimeter of Mercury', :read_only => 'true', :id => '786', :submission_value => 'mmHg' },
  { :sdtm_category_id => '29', :cdisc_preferred_term => 'ohm', :synonyms => 'ohm', :definition => 'A unit of electrical resistance equal to the resistance between two points on a conductor when a potential difference of one volt between them produces a current of one Ampere. Ohm is also used to measure impedance and reactance for complex resistance. A measurement in ohms is the reciprocal of a measurement in Siemens. (NCI)', :code => 'C42554', :nci_preferred_term => 'Ohm', :read_only => 'true', :id => '787', :submission_value => 'ohm' },
  { :sdtm_category_id => '30', :cdisc_preferred_term => 'BMI', :synonyms => 'Body Mass Index', :definition => 'A general indicator of the body fat an individual is carrying based upon the ratio of weight to height. (NCI)', :code => 'C16358', :nci_preferred_term => 'Body Mass Index', :read_only => 'true', :id => '789', :submission_value => 'BMI' },
  { :sdtm_category_id => '30', :cdisc_preferred_term => 'BODYFAT', :synonyms => 'Adipose Tissue', :definition => 'A specialized form of connective tissue consisting primarily of adipocytes (fat cells), surrounded by a meshwork of collagen fibers.', :code => 'C12472', :nci_preferred_term => 'Adipose Tissue', :read_only => 'true', :id => '790', :submission_value => 'BODYFAT' },
  { :sdtm_category_id => '30', :cdisc_preferred_term => 'BSA', :synonyms => 'Body Surface Area', :definition => 'A measure of the 2-dimensional extent of the body surface (i.e., the skin). Body surface area (BSA) can be calculated by mathematical formula or from a chart that relates height to weight. BSA is often an important factor in dosing. (NCI)', :code => 'C25157', :nci_preferred_term => 'Body Surface Area', :read_only => 'true', :id => '791', :submission_value => 'BSA' },
  { :sdtm_category_id => '30', :cdisc_preferred_term => 'DIABP', :synonyms => 'Diastolic Blood Pressure', :definition => 'The blood pressure after the contraction of the heart while the chambers of the heart refill with blood. (NCI)', :code => 'C25299', :nci_preferred_term => 'Diastolic Blood Pressure', :read_only => 'true', :id => '792', :submission_value => 'DIABP' },
  { :sdtm_category_id => '30', :cdisc_preferred_term => 'FRMSIZE', :synonyms => 'Body Frame Size', :definition => 'The categorization of a person\'s body frame into small, medium and large based on the measurement of wrist circumference or the breadth of the elbow. (NCI)', :code => 'C49680', :nci_preferred_term => 'Body Frame Size', :read_only => 'true', :id => '793', :submission_value => 'FRMSIZE' },
  { :sdtm_category_id => '30', :cdisc_preferred_term => 'HEIGHT', :synonyms => 'Height', :definition => 'The vertical measurement or distance from the base to the top of an object; the vertical dimension of extension. (NCI)', :code => 'C25347', :nci_preferred_term => 'Height', :read_only => 'true', :id => '794', :submission_value => 'HEIGHT' },
  { :sdtm_category_id => '30', :cdisc_preferred_term => 'HR', :synonyms => 'Heart Rate', :definition => 'The number of heartbeats per unit of time, usually expressed as beats per minute. (NCI)', :code => 'C49677', :nci_preferred_term => 'Heart Rate', :read_only => 'true', :id => '795', :submission_value => 'HR' },
  { :sdtm_category_id => '30', :cdisc_preferred_term => 'MAP', :synonyms => 'Mean Arterial Pressure', :definition => 'The mean pressure of the blood within the arterial circulation. The arterial pressure may be directly measured by insertion of an intra-arterial catheter connected to a transducer. The mean arterial pressure (MAP) can be calculated by subsequent analysis of the waveform. MAP can be approximated without an invasive procedure using the following formula: diastolic pressure plus 1/3 of the pulse pressure, where pulse pressure is systolic pressure - diastolic pressure. (NCI)', :code => 'C49679', :nci_preferred_term => 'Mean Arterial Pressure', :read_only => 'true', :id => '796', :submission_value => 'MAP' },
