  { :sdtm_category_id => '37', :cdisc_preferred_term => 'VENTRICULAR ARRHYTHMIA ASSOCIATED WITH LONG QT SYNDROME', :synonyms => 'Ventricular arrhythmia associated with long QT syndrome', :definition => 'A ventricular arrhythmia characterized by syncopal episodes and a long QT interval, sometimes leading to sudden death due to paroxysmal ventricular arrhythmia. This arrhythmia is associated with a prolongation of repolarization following depolarization of the cardiac ventricles. The prolongation of the Q-T interval combined with torsades de pointes manifests as several different forms; some may be acquired or congenital; some may lead to serious arrhythmia and sudden cardiac death. (NCI)', :code => 'C34786', :nci_preferred_term => 'Long QT Syndrome', :read_only => 'true', :id => '1724', :submission_value => 'VENTRICULAR ARRHYTHMIA ASSOCIATED WITH LONG QT SYNDROME' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'PRE-EXCITATION', :synonyms => 'Pre-excitation', :definition => 'A condition characterized by the activation of the whole or some part of the ventricle by the transmission of an atrial impulse along an accessory pathway rather than by way of the normal specific conduction system which includes a delay at the atrioventricular node. (NCI)', :code => 'C34940', :nci_preferred_term => 'Pre-Excitation Syndrome', :read_only => 'true', :id => '1725', :submission_value => 'PRE-EXCITATION' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'AV NODE RE-ENTRY', :synonyms => 'AV node re-entry', :definition => 'A supraventricular tachycardia due to reentry along a circuit contained within the AV node. AVNRT is the most common form of supraventricular tachycardia and usually presents as a narrow QRS complex tachycardia at a rate between 150 and 250 beats per minute. (NCI)', :code => 'C35058', :nci_preferred_term => 'Atrioventricular Nodal Reentry Tachycardia', :read_only => 'true', :id => '1726', :submission_value => 'AV NODE RE-ENTRY' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'JUNCTIONAL TACHYCARDIA', :synonyms => 'Junctional tachycardia', :definition => 'An automatic tachycardia originating in the atrioventricular junction, typically arising in the conduction tissues surrounding the atrioventricular node. A junctional tachycardia tends to be a regular, narrow complex tachycardia and usually occurs during myocardial infarction, after heart surgery, or in digitalis intoxication. The rate may range from 140 to 250 beats per minute. (NCI)', :code => 'C35059', :nci_preferred_term => 'Junctional Tachycardia', :read_only => 'true', :id => '1727', :submission_value => 'JUNCTIONAL TACHYCARDIA' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'SUPRAVENTRICULAR TACHYCARDIA', :synonyms => 'Supraventricular tachycardia', :definition => 'A generic expression for any tachycardia that originates in the atria or the atrioventricular node. (NCI)', :code => 'C35061', :nci_preferred_term => 'Supraventricular Tachycardia', :read_only => 'true', :id => '1728', :submission_value => 'SUPRAVENTRICULAR TACHYCARDIA' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'WOLFF-PARKINSON-WHITE SYNDROME', :synonyms => 'Wolff-Parkinson-White syndrome', :definition => 'A type of ventricular pre-excitation resulting from the activation of an accessory pathway known as the Bundle of Kent. This pathway presents an abnormal electrical communication from the atria to the ventricles. Wolff-Parkinson-White syndrome is characterized by a short PR interval and a long QRS interval with a delta wave. (NCI)', :code => 'C35132', :nci_preferred_term => 'Wolff-Parkinson-White Syndrome', :read_only => 'true', :id => '1729', :submission_value => 'WOLFF-PARKINSON-WHITE SYNDROME' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ATRIAL TACHYCARDIA', :synonyms => 'Atrial tachycardia', :definition => 'Any rapid heart rhythm originating in the atria. Atrial fibrillation and atrial flutter are varieties of atrial tachycardia. Atrial tachycardia is an electrical circuit originating in the upper or atrial chambers. This electrical circuit or focus takes over and generates rapid impulses across the atrial chambers. These impulses are transmitted to the ventricular chambers resulting in a rapid rate. These arrhythmias may originate from a variety of places across the atria. They may exist as an isolated problem or be related to an ongoing structural problem within the heart. (NCI)', :code => 'C35481', :nci_preferred_term => 'Atrial Tachycardia', :read_only => 'true', :id => '1730', :submission_value => 'ATRIAL TACHYCARDIA' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ATRIAL FIBRILLATION', :synonyms => 'Atrial fibrillation', :definition => 'A supraventricular arrhythmia characterized by uncoordinated atrial myocardium activation due to multiple reentry circuits with consequent deterioration of atrial mechanical function. Instead of intermittently contracting, the atria quiver continuously in a chaotic pattern, causing a totally irregular, often tachycardia ventricular rate. On the ECG it is described by the replacement of consistent P waves by rapid oscillations or fibrillatory waves that vary in size, shape, and timing, associated with an irregular, frequently rapid ventricular response when atrioventricular conduction is intact. (NCI)', :code => 'C50466', :nci_preferred_term => 'Atrial Fibrillation', :read_only => 'true', :id => '1731', :submission_value => 'ATRIAL FIBRILLATION' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => '3RD DEGREE AV BLOCK', :synonyms => '3rd degree AV block', :definition => 'Complete failure of atrial electrical impulse conduction through the AV node to the ventricles. (NCI)', :code => 'C50501', :nci_preferred_term => 'AV Block Third Degree', :read_only => 'true', :id => '1732', :submission_value => '3RD DEGREE AV BLOCK' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'TORSADES DE POINTES', :synonyms => 'Torsades de pointes', :definition => 'An atypical rapid polymorphic ventricular tachycardia with a characteristic rotation of the QRS complex around the isoelectric baseline. In addition the QRS complex displays a periodic waxing and waning of amplitude on the electrogram. (NCI)', :code => 'C50779', :nci_preferred_term => 'Torsades De Pointes', :read_only => 'true', :id => '1733', :submission_value => 'TORSADES DE POINTES' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'VENTRICULAR FIBRILLATION', :synonyms => 'Ventricular fibrillation', :definition => 'An arrhythmia characterized by an irregular pattern of high or low-amplitude waves that cannot be differentiated into QRS complexes or T waves. These electrocardiographic waves occur as a result of fibrillary contractions of the ventricular muscle due to rapid repetitive excitation of myocardial fibers without coordinated contraction of the ventricle. (NCI)', :code => 'C50799', :nci_preferred_term => 'Ventricular Fibrillation', :read_only => 'true', :id => '1734', :submission_value => 'VENTRICULAR FIBRILLATION' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'VENTRICULAR FLUTTER', :synonyms => 'Ventricular flutter', :definition => 'A ventricular tachyarrhythmia characterized by a high ventricular rate (180 and 250 beats per minute) with a regular rhythm. The electrocardiogram shows large oscillating sine wave-like complexes occurring as a result of QRS complexes and T waves being merged. The P wave is not visible. (NCI)', :code => 'C50800', :nci_preferred_term => 'Ventricular Flutter', :read_only => 'true', :id => '1735', :submission_value => 'VENTRICULAR FLUTTER' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'VENTRICULAR TACHYCARDIA', :synonyms => 'Ventricular tachycardia', :definition => 'A tachycardia arising distal to bundle of His, with a rate greater than 100 beats per minute. (NCI)', :code => 'C50802', :nci_preferred_term => 'Ventricular Tachycardia', :read_only => 'true', :id => '1736', :submission_value => 'VENTRICULAR TACHYCARDIA' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ATRIAL FLUTTER', :synonyms => 'Atrial flutter', :definition => 'An electrocardiographic finding of an organized rhythmic contraction of the atria which is generally at a rate of 200-300 beats per minute. (NCI)', :code => 'C51224', :nci_preferred_term => 'Atrial Flutter', :read_only => 'true', :id => '1737', :submission_value => 'ATRIAL FLUTTER' }
