  { :sdtm_category_id => '37', :cdisc_preferred_term => 'VENTRICULAR TACHYCARDIA, POLYMORPHIC', :synonyms => 'Ventricular tachycardia, polymorphic', :definition => 'A ventricular tachycardia in which the ventricular activation sequence is variable. The morphology of the electrocardiographic waveform is variable and is referred to as polymorphic. (NCI)', :code => 'C62236', :nci_preferred_term => 'Polymorphic Ventricular Tachycardia', :read_only => 'true', :id => '1742', :submission_value => 'VENTRICULAR TACHYCARDIA, POLYMORPHIC' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'SINUS ARRHYTHMIA', :synonyms => 'Sinus arrhythmia', :definition => 'Irregularity of the heartbeat due to a variation in the sinus rhythm resulting in cyclic changes in the heart rate during breathing. This rhythm is most commonly seen with breathing due to fluctuations in parasympathetic vagal tone. During inspiration stretch receptors in the lungs stimulate the cardioinhibitory centers in the medulla via fibers in the vagus nerve. Irregularity of the heartbeat due to a variation in the sinus rhythm resulting in cyclic changes in the heart rate during breathing. This rhythm is most commonly seen with breathing due to fluctuations in parasympathetic vagal tone. During inspiration stretch receptors in the lungs stimulate the cardioinhibitory centers in the medulla via fibers in the vagus nerve. (NCI)', :code => 'C62239', :nci_preferred_term => 'Sinus Arrhythmia', :read_only => 'true', :id => '1743', :submission_value => 'SINUS ARRHYTHMIA' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'WANDERING ATRIAL PACEMAKER', :synonyms => 'Wandering atrial pacemaker', :definition => 'A condition characterized by the site of origin of impulses, controlling the heart rate, changing within the atria, including the sinus node. Variations within P waves and PR intervals occur and an irregular rate of impulse formation is observed. (NCI)', :code => 'C62240', :nci_preferred_term => 'Wandering Atrial Pacemaker', :read_only => 'true', :id => '1744', :submission_value => 'WANDERING ATRIAL PACEMAKER' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'SINUS ARREST/PAUSE', :synonyms => 'Sinus arrest/pause', :definition => 'A failure of impulse formation in the sinus node. Sinus arrest is indistinguishable from third degree sinoatrial exit block on the standard ECG. (NCI)', :code => 'C62242', :nci_preferred_term => 'Sinus Arrest', :read_only => 'true', :id => '1745', :submission_value => 'SINUS ARREST/PAUSE' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'SINUS NODE DYSFUNCTION (BRADYCARDIA)', :synonyms => 'Sinus node dysfunction (bradycardia)', :definition => 'A derangement in the normal functioning of the sinoatrial node. Typically, SA node dysfunction is manifest as sinoatrial exit block or sinus arrest, but may present as an absolute or relative bradycardia in the presence of a stressor. It may be associated with bradycardia-tachycardia syndrome. (NCI)', :code => 'C62243', :nci_preferred_term => 'Sinus Node Dysfunction', :read_only => 'true', :id => '1746', :submission_value => 'SINUS NODE DYSFUNCTION (BRADYCARDIA)' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'SICK SINUS SYNDROME', :synonyms => 'Sick sinus syndrome', :definition => 'A constellation of signs and symptoms which may include syncope, fatigue, dizziness, and alternating periods of bradycardia and atrial tachycardia, which is caused by sinoatrial node dysfunction. (NCI)', :code => 'C62244', :nci_preferred_term => 'Sick Sinus Syndrome', :read_only => 'true', :id => '1747', :submission_value => 'SICK SINUS SYNDROME' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ECTOPIC ATRIAL RHYTHM', :synonyms => 'Ectopic atrial rhythm', :definition => 'A cardiac rhythm resulting from either an abnormal electrical focus in the atria or intra-atrial reentry. Atrial ectopic beats (AEB) refer to a contraction of the upper heart chamber which occurs before it would be expected. Atrial ectopic beats are also known as premature atrial beats, premature atrial complex (PAC), or atrial extrasystole. (NCI)', :code => 'C62245', :nci_preferred_term => 'Ectopic Atrial Rhythm', :read_only => 'true', :id => '1748', :submission_value => 'ECTOPIC ATRIAL RHYTHM' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'SHORT PR INTERVAL', :synonyms => 'Short PR interval', :definition => 'A PR interval of less than 0.12 seconds. (NCI)', :code => 'C62246', :nci_preferred_term => 'Short PR Interval', :read_only => 'true', :id => '1749', :submission_value => 'SHORT PR INTERVAL' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'PR PROLONGATION', :synonyms => 'PR prolongation', :definition => 'A PR interval of more than 0.20 seconds in adults. (NCI)', :code => 'C62247', :nci_preferred_term => 'Prolonged PR Interval', :read_only => 'true', :id => '1750', :submission_value => 'PR PROLONGATION' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ISORHYTHMIC DISSOCIATION', :synonyms => 'Isorhythmic dissociation', :definition => 'A type of atrioventricular dissociation characterized by atria and ventricles beating at similar rates, although independently. (NCI)', :code => 'C62248', :nci_preferred_term => 'Isorhythmic Atrioventricular Dissociation', :read_only => 'true', :id => '1751', :submission_value => 'ISORHYTHMIC DISSOCIATION' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'PAROXYSMAL AV BLOCK', :synonyms => 'Paroxysmal AV block', :definition => 'Sudden onset AV block, often associated with preexisting conduction disorders. (NCI)', :code => 'C62250', :nci_preferred_term => 'Paroxysmal Atrioventricular Block', :read_only => 'true', :id => '1752', :submission_value => 'PAROXYSMAL AV BLOCK' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'INAPPROPRIATE SINUS TACHYCARDIA', :synonyms => 'Inappropriate sinus tachycardia', :definition => 'Inappropriate sinus tachycardia (IST) is a rare form of supraventricular tachycardia involving the sinus node, in which a patient has an abnormally high heart rate, occurring both at rest and in response to stressors (such as physical activity). (NCI)', :code => 'C62253', :nci_preferred_term => 'Inappropriate Sinus Tachycardia', :read_only => 'true', :id => '1753', :submission_value => 'INAPPROPRIATE SINUS TACHYCARDIA' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'PREMATURE VENTRICULAR COMPLEX', :synonyms => 'PVC', :definition => 'Ectopic impulses originating in the ventricles. (NCI)', :code => 'C62256', :nci_preferred_term => 'Ventricular Premature Complex', :read_only => 'true', :id => '1754', :submission_value => 'PREMATURE VENTRICULAR COMPLEX' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'PREMATURE ATRIAL COMPLEXES', :synonyms => 'Premature atrial complexes', :definition => 'Ectopic impulses originating in the atria. (NCI)', :code => 'C62257', :nci_preferred_term => 'Atrial Premature Complex', :read_only => 'true', :id => '1755', :submission_value => 'PREMATURE ATRIAL COMPLEXES' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'DELTA WAVE', :synonyms => 'Delta wave', :definition => 'An initial slurring (delta wave) of the QRS complex due to the presence of an accessory pathway. This characteristic EKG pattern is typically seen in Wolff-Parkinson-White syndrome. (NCI)', :code => 'C62258', :nci_preferred_term => 'EKG Delta Wave', :read_only => 'true', :id => '1756', :submission_value => 'DELTA WAVE' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'VENTRICULAR COUPLET', :synonyms => 'Ventricular couplet', :definition => 'Two sequential ventricular premature complexes. An otherwise normal finding, but possibly indicative of electrical heart disease particularly in comparison with a single ventricular premature complexes. (NCI)', :code => 'C62259', :nci_preferred_term => 'Ventricular Couplet', :read_only => 'true', :id => '1757', :submission_value => 'VENTRICULAR COUPLET' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'AV RE-ENTRANT TACHYCARDIA', :synonyms => 'AV re-entrant tachycardia', :definition => 'A supraventricular tachycardia due to reentry along a circuit including a concealed AV nodal bypass tract. This tachycardia circuit proceeds in an antegrade fashion through the AV node and then is conducted retrograde through the bypass tract into the atria. (NCI)', :code => 'C62261', :nci_preferred_term => 'Atrioventricular Reentrant Tachycardia', :read_only => 'true', :id => '1758', :submission_value => 'AV RE-ENTRANT TACHYCARDIA' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ACCELERATED IDIOVENTRICULAR RHYTHM', :synonyms => 'Accelerated idioventricular rhythm', :definition => 'The term accelerated idioventricular rhythm describes an ectopic ventricular rhythm with 3 or more consecutive ventricular premature beats with a rate faster than the normal ventricular intrinsic escape rate of 30 to 40 beats per minute, but slower than ventricular tachycardia. Accelerated idioventricular rhythm differs from ventricular tachycardia by additional features such as the onset with a long coupling interval and the end by a gradual decrease of the ventricular rate or increase of the sinus rate. (NCI)', :code => 'C62266', :nci_preferred_term => 'Accelerated Idioventricular Rhythm', :read_only => 'true', :id => '1759', :submission_value => 'ACCELERATED IDIOVENTRICULAR RHYTHM' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'LEFT ANTERIOR FASCICULAR BLOCK', :synonyms => 'Left anterior fascicular block', :definition => 'An impairment of transmission of the cardiac electrical impulse along the fibers of the left anterior fascicle. In left anterior fascicular block (LAFB) the posteroinferior regions of the left ventricular endocardium are activated abnormally before the anterosuperior left ventricular area. After emerging from the posteroinferior division of the left bundle branch, the impulse first propagates in an inferior, rightward, and usually anterior direction for a short period of time. This orientation is responsible for the small Q waves in leads 1 and aVL and for the R waves in leads II, III, and aVF. (NCI)', :code => 'C62267', :nci_preferred_term => 'Left Anterior Fascicular Block', :read_only => 'true', :id => '1760', :submission_value => 'LEFT ANTERIOR FASCICULAR BLOCK' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'LEFT POSTERIOR FASCICULAR BLOCK', :synonyms => 'Left posterior fascicular block', :definition => 'An impairment of transmission of the cardiac electrical impulse along the fibers of the left posterior fascicle. In pure left posterior fascicular block (LPFB), the impulse emerges from the unblocked anterosuperior division, thus producing small q waves in leads II, III, and aVF. Thereafter, the impulse moves through the electrically predominant left ventricle in an inferior and rightward direction, thus explaining the S waves in leads I and aVL as well as the R waves in leads II, III, and aVF. (NCI)', :code => 'C62268', :nci_preferred_term => 'Left Posterior Fascicular Block', :read_only => 'true', :id => '1761', :submission_value => 'LEFT POSTERIOR FASCICULAR BLOCK' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'LEFT BUNDLE BRANCH BLOCK', :synonyms => 'Left bundle branch block', :definition => 'An impairment of transmission of the cardiac electrical impulse along the fibers of the left main bundle branch, or both the left anterior fascicle and left posterior fascicle. This conduction disturbance is characterized by wide (greater than 0.11s) QRS complexes. The diagnostic criteria consist of prolongation of the QRS complexes (over 0.11s) with neither a Q wave nor an S wave in lead V1 and in the properly placed V6. A wide R wave with a notch on its top (plateau) is seen in these leads. In hearts with an electrical (and anatomic) vertical position a small Q wave may be seen in AVL in the absence of MI. Right chest lead V1 may or may not show an initial R wave, but the latter should be present in lead V2. (NCI)', :code => 'C62269', :nci_preferred_term => 'Left Bundle Branch Block', :read_only => 'true', :id => '1762', :submission_value => 'LEFT BUNDLE BRANCH BLOCK' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'RIGHT BUNDLE BRANCH BLOCK', :synonyms => 'Right Bundle Branch Block', :definition => 'An impairment of transmission of the cardiac electrical impulse along the fibers of the right bundle branch. A "complete RBBB pattern" (with QRS duration > 0.11s) does not necessarily reflect the existence of a total conduction block in the right branch. This pattern only indicates that the entire or major parts of both ventricles are activated by the impulse emerging from the left branch. Thus, a significant degree of conduction delay ("high-grade" or "incomplete RBBB") can produce a similar pattern. (NCI)', :code => 'C62270', :nci_preferred_term => 'Right Bundle Branch Block', :read_only => 'true', :id => '1763', :submission_value => 'RIGHT BUNDLE BRANCH BLOCK' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'INTRAVENTRICULAR CONDUCTION DELAY, NONSPECIFIC', :synonyms => 'Intraventricular conduction delay, nonspecific', :definition => 'A delay in transmission of cardiac electrical impulses in the His-Purkinje system, diagnosed when the QRS is modestly prolonged (< 120 msec) and the QRS pattern and axis are not typical of a hemiblock. The conduction delay is considered to occur beyond the Purkinje\'s myocardial gates and arises from slow cell-to-cell conduction. The phenomenon is common in patients with acute MI. (NCI)', :code => 'C62271', :nci_preferred_term => 'Nonspecific Intraventricular Conduction Delay', :read_only => 'true', :id => '1764', :submission_value => 'INTRAVENTRICULAR CONDUCTION DELAY, NONSPECIFIC' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ST SEGMENT ABNORMALITY', :synonyms => 'ST segment abnormality', :definition => 'An electrocardiographic finding of the ST segment elevation or depression which is not indicative of ischemia or infarction. (NCI)', :code => 'C71026', :nci_preferred_term => 'ST Segment Abnormality', :read_only => 'true', :id => '1765', :submission_value => 'ST SEGMENT ABNORMALITY' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ST DEPRESSION', :synonyms => 'ST depression', :definition => 'An electrocardiographic finding of ST segment depression below the baseline, often described as up sloping, down sloping or horizontal. (NCI)', :code => 'C71027', :nci_preferred_term => 'ST Depression', :read_only => 'true', :id => '1766', :submission_value => 'ST DEPRESSION' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ST ELEVATION', :synonyms => 'ST elevation', :definition => 'An electrocardiographic finding of ST segment elevation above the baseline. (NCI)', :code => 'C71028', :nci_preferred_term => 'ST Elevation', :read_only => 'true', :id => '1767', :submission_value => 'ST ELEVATION' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ST ELEVATION PERICARDITIS', :synonyms => 'ST elevation pericarditis', :definition => 'An electrocardiographic finding of ST changes consistent with pericarditis. (NCI)', :code => 'C71029', :nci_preferred_term => 'ST Elevation Pericarditis', :read_only => 'true', :id => '1768', :submission_value => 'ST ELEVATION PERICARDITIS' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'J POINT ELEVATION', :synonyms => 'J point elevation', :definition => 'Elevation of the J point above the baseline; the J point represents the end of ventricular depolarization and located at the terminus of the QRS complex. (NCI)', :code => 'C71030', :nci_preferred_term => 'J Point Elevation', :read_only => 'true', :id => '1769', :submission_value => 'J POINT ELEVATION' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'NON-SPECIFIC ST-T CHANGES', :synonyms => 'Non-specific ST-T changes', :definition => 'An electrocardiographic finding of changes in the ST segment and T wave that do not meet criteria for ischemia or infarction. (NCI)', :code => 'C71031', :nci_preferred_term => 'Non-Specific ST-T Changes', :read_only => 'true', :id => '1770', :submission_value => 'NON-SPECIFIC ST-T CHANGES' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'NOTCHED T-WAVES', :synonyms => 'Notched T-waves', :definition => 'Any depression occurring in a positive t wave. (NCI)', :code => 'C71032', :nci_preferred_term => 'Notched T-Waves', :read_only => 'true', :id => '1771', :submission_value => 'NOTCHED T-WAVES' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'POOR R WAVE PROGRESSION', :synonyms => 'Poor R Wave Progression', :definition => 'Lack of progression of R wave height across precordial leads. (NCI)', :code => 'C71033', :nci_preferred_term => 'Poor R Wave Progression', :read_only => 'true', :id => '1772', :submission_value => 'POOR R WAVE PROGRESSION' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'PROLONGED QT', :synonyms => 'Prolonged QT', :definition => 'A QT interval that is prolonged. The length of the QT interval varies with the heart rate. (NCI)', :code => 'C71034', :nci_preferred_term => 'Prolonged QT Interval', :read_only => 'true', :id => '1773', :submission_value => 'PROLONGED QT' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ELECTRICAL ALTERNANS', :synonyms => 'Electrical alternans', :definition => 'An electrocardiographic finding in which there is an alternating pattern of any of the waveform components. (NCI)', :code => 'C71035', :nci_preferred_term => 'Electrical Alternans', :read_only => 'true', :id => '1774', :submission_value => 'ELECTRICAL ALTERNANS' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'SINOATRIAL EXIT BLOCK', :synonyms => 'Sinoatrial exit block', :definition => 'A blockage of electrical conduction within the sinoatrial node resulting in the failure of impulse transmission from the sinoatrial node. (NCI)', :code => 'C71038', :nci_preferred_term => 'Sinoatrial Node Exit Block', :read_only => 'true', :id => '1775', :submission_value => 'SINOATRIAL EXIT BLOCK' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ATRIAL ENLARGEMENT', :synonyms => 'Atrial Enlargement', :definition => 'An electrocardiographic finding which comprises left, right or bilateral atrial enlargement. (NCI)', :code => 'C71039', :nci_preferred_term => 'EKG Finding Atrial Enlargement', :read_only => 'true', :id => '1776', :submission_value => 'ATRIAL ENLARGEMENT' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'LEFT ATRIAL ENLARGEMENT', :synonyms => 'P-mitrale', :definition => 'An electrocardiographic finding suggesting underlying hypertrophy or dilatation of the left atrium. Electrocardiographic criteria used for the diagnosis of left atrial abnormality may include a bifid p wave, a biphasic p wave and/or a p wave duration of greater than 0.12 seconds. (NCI)', :code => 'C71040', :nci_preferred_term => 'P-mitrale', :read_only => 'true', :id => '1777', :submission_value => 'LEFT ATRIAL ENLARGEMENT' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'RIGHT ATRIAL ABNORMALITY', :synonyms => 'P-pulmonale', :definition => 'An electrocardiographic finding suggesting underlying hypertrophy or dilatation of the right atrium. Electrocardiographic criteria used for the diagnosis of right atrial abnormality may include a peaked p wave greater than 2.5 millimeters in amplitude in the inferior leads. (NCI)', :code => 'C71041', :nci_preferred_term => 'P-pulmonale', :read_only => 'true', :id => '1778', :submission_value => 'RIGHT ATRIAL ABNORMALITY' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ECTOPIC VENTRICULAR RHYTHM', :synonyms => 'Ectopic ventricular rhythm', :definition => 'A cardiac rhythm resulting from either an abnormal electrical focus in the ventricle. Ventricular ectopic beats (VEB) refer to a contraction of the lower heart chamber which occurs before it would be expected. Ventricular ectopic beats are also known as premature ventricular beats, premature ventricular complex (PVC), or ventricular extrasystole. (NCI)', :code => 'C71042', :nci_preferred_term => 'Ectopic Ventricular Rhythm', :read_only => 'true', :id => '1779', :submission_value => 'ECTOPIC VENTRICULAR RHYTHM' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ECTOPIC SUPRAVENTRICULAR RHYTHM', :synonyms => 'Ectopic supraventricular rhythm', :definition => 'An electrocardiographic finding of a rhythm originating at a site other than the sinoatrial node, which is also above the atrioventricular node. (NCI)', :code => 'C71043', :nci_preferred_term => 'Ectopic Supraventricular Rhythm', :read_only => 'true', :id => '1780', :submission_value => 'ECTOPIC SUPRAVENTRICULAR RHYTHM' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => '2:1 AV BLOCK', :synonyms => '2:1 AV block', :definition => 'A electrocardiographic finding of an electrical phenomenon in which the ratio of electrical impulse generated above the atrioventricular node to the number of impulses conducted through to the ventricles is 2:1. (NCI)', :code => 'C71044', :nci_preferred_term => '2:1 Atrioventricular Block', :read_only => 'true', :id => '1781', :submission_value => '2:1 AV BLOCK' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'ATRIOVENTRICULAR DISSOCIATION', :synonyms => 'Atrioventricular dissociation', :definition => 'An electrocardiographic finding in which the electrical activity of the atria and ventricles are causally independent of one another. (NCI)', :code => 'C71045', :nci_preferred_term => 'Atrioventricular Dissociation', :read_only => 'true', :id => '1782', :submission_value => 'ATRIOVENTRICULAR DISSOCIATION' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'BIFASCICULAR BLOCK', :synonyms => 'Bifascicular block', :definition => 'An electrocardiographic finding comprising right bundle branch block and left anterior fascicular block, or right bundle branch block and left posterior fascicular block. Defects occurring in two of the three divisions of the conduction system of the heart are considered bifascicular blocks. Technically left bundle branch block may be considered a bifascicular block. (NCI)', :code => 'C71046', :nci_preferred_term => 'Bifascicular Block', :read_only => 'true', :id => '1783', :submission_value => 'BIFASCICULAR BLOCK' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'INCOMPLETE LEFT BUNDLE BRANCH BLOCK', :synonyms => 'Incomplete left bundle branch block', :definition => 'An partial impairment of transmission of the cardiac electrical impulse along the fibers of the left bundle branch. (NCI)', :code => 'C71047', :nci_preferred_term => 'Incomplete Left Bundle Branch Block', :read_only => 'true', :id => '1784', :submission_value => 'INCOMPLETE LEFT BUNDLE BRANCH BLOCK' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'INCOMPLETE RIGHT BUNDLE BRANCH BLOCK', :synonyms => 'Incomplete right bundle branch block', :definition => 'Various mechanisms may result in a pattern showing an incomplete right bundle branch block (RBBB). These include different degrees of conduction delay through the main trunk of the right bundle branch; increased conduction time through an elongated right bundle branch; diffuse Purkinje-myocardial delay due to right ventricular stretch or dilatation; surgical trauma or disease-related interruption of the major ramifications of the right branch (distal RBBB or right fascicular blocks); congenital variations of the distribution of the major ramifications resulting in a slight delay in the activation of the crista supraventricularis. (NCI)', :code => 'C71048', :nci_preferred_term => 'Incomplete Right Bundle Branch Block', :read_only => 'true', :id => '1785', :submission_value => 'INCOMPLETE RIGHT BUNDLE BRANCH BLOCK' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'INCOMPLETE BUNDLE BRANCH BLOCK', :synonyms => 'Incomplete bundle branch block', :definition => 'An electrocardiographic finding of bundle branch block which does not meet the criteria for a more specific bundle branch block. (NCI)', :code => 'C71049', :nci_preferred_term => 'Incomplete Bundle Branch Block', :read_only => 'true', :id => '1786', :submission_value => 'INCOMPLETE BUNDLE BRANCH BLOCK' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'MULTIFOCAL ATRIAL TACHYCARDIA', :synonyms => 'Multifocal atrial tachycardia', :definition => 'An electrocardiographic finding in which the electrical axis of the p wave is variable and the rate is greater than 100 beats per minute. To meet criteria for multifocal atrial tachycardia, the p wave must exhibit three distinct morphologies on the rhythm strip. (NCI)', :code => 'C71050', :nci_preferred_term => 'Multifocal Atrial Tachycardia', :read_only => 'true', :id => '1787', :submission_value => 'MULTIFOCAL ATRIAL TACHYCARDIA' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'JUNCTIONAL RHYTHM', :synonyms => 'Junctional rhythm', :definition => 'An electrocardiographic finding in which the pacer of the heart is located in the AV junction, normally presenting with a narrow QRS complex and a rate of 60-100 beats per minute. (NCI)', :code => 'C71051', :nci_preferred_term => 'Junctional Rhythm', :read_only => 'true', :id => '1788', :submission_value => 'JUNCTIONAL RHYTHM' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'SUSTAINED VENTRICULAR TACHYCARDIA', :synonyms => 'Sustained ventricular tachycardia', :definition => 'An electrocardiographic finding of ventricular tachycardia greater than 30 seconds in duration. (NCI)', :code => 'C71052', :nci_preferred_term => 'Sustained Ventricular Tachycardia', :read_only => 'true', :id => '1789', :submission_value => 'SUSTAINED VENTRICULAR TACHYCARDIA' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'NON-SUSTAINED VENTRICULAR TACHYCARDIA', :synonyms => 'Non-sustained ventricular tachycardia', :definition => 'An electrocardiographic finding of ventricular tachycardia less than 30 seconds in duration. (NCI)', :code => 'C71053', :nci_preferred_term => 'Non-Sustained Ventricular Tachycardia', :read_only => 'true', :id => '1790', :submission_value => 'NON-SUSTAINED VENTRICULAR TACHYCARDIA' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'BIGEMINY', :synonyms => 'Bigeminy', :definition => 'An electrocardiographic finding of a normal QRS followed by a premature ventricular contraction; a rhythmic pairing of normal and abnormal beats originating in the ventricles in a 1-1 ratio. (NCI)', :code => 'C71054', :nci_preferred_term => 'Bigeminy', :read_only => 'true', :id => '1791', :submission_value => 'BIGEMINY' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'TRIGEMINY', :synonyms => 'Trigeminy', :definition => 'An electrocardiographic finding of normal QRS followed by a premature ventricular contraction; a rhythmic pairing of normal and abnormal beats originating from the ventricles in a 1-2 ratio. (NCI)', :code => 'C71055', :nci_preferred_term => 'Trigeminy', :read_only => 'true', :id => '1792', :submission_value => 'TRIGEMINY' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'VENTRICULAR TACHYCARDIA STORM', :synonyms => 'Ventricular tachycardia storm', :definition => 'Multiple, temporally related, episodes of ventricular tachycardia or fibrillation, occurring three or more times in a 24 hour period. (NCI)', :code => 'C71056', :nci_preferred_term => 'Ventricular Tachycardia Storm', :read_only => 'true', :id => '1793', :submission_value => 'VENTRICULAR TACHYCARDIA STORM' },
