  { :sdtm_category_id => '37', :cdisc_preferred_term => 'VERAPAMIL-SENSITIVE VENTRICULAR TACHYCARDIA', :synonyms => 'Verapamil-sensitive ventricular tachycardia', :definition => 'A well-recognized condition that is believed to result from triggered activity. Despite its uniform response to verapamil, however, this uncommon form of ventricular tachycardia may not be as homogeneous a condition as first believed. (NCI)', :code => 'C71058', :nci_preferred_term => 'Verapamil-Sensitive Ventricular Tachycardia', :read_only => 'true', :id => '1795', :submission_value => 'VERAPAMIL-SENSITIVE VENTRICULAR TACHYCARDIA' },
  { :sdtm_category_id => '37', :cdisc_preferred_term => 'VENTRICULAR ARRHYTHMIA ASSOCIATED WITH BRUGADA SYNDROME', :synonyms => 'Ventricular arrhythmia associated with Brugada syndrome', :definition => 'A condition characterized by a pattern of right bundle branch block (RBBB) and ST-segment elevation within electrocardiogram (ECG) leads V1-V3 . This pattern emerges as a result of a defect in ion channel genes, resulting in abnormal electrophysiological activity in the right ventricle and a propensity to malignant tachyarrhythmias. (NCI)', :code => 'C71059', :nci_preferred_term => 'Brugada Syndrome', :read_only => 'true', :id => '1796', :submission_value => 'VENTRICULAR ARRHYTHMIA ASSOCIATED WITH BRUGADA SYNDROME' },
