  { :sdtm_category_id => '37', :cdisc_preferred_term => 'FASCICULAR TACHYCARDIA', :synonyms => 'Fascicular tachycardia', :definition => 'A distinct subgroup of idiopathic ventricular tachycardia (VT) that may be confused with either typical VT or supraventricular tachycardia (SVT). It is characterized by the absence of structural heart disease and classic electrocardiographic and electrophysiological features. It originates from the region of the posterior fascicle (or occasionally the anterior fascicle) of the left bundle branch and is partly propagated by the His-Purkinje network. It therefore produces QRS complexes of relatively short duration (0.11-0.14)s. (NCI)', :code => 'C71061', :nci_preferred_term => 'Fascicular Tachycardia', :read_only => 'true', :id => '1798', :submission_value => 'FASCICULAR TACHYCARDIA' },
