  { :sdtm_category_id => '37', :cdisc_preferred_term => 'IDIOPATHIC RIGHT BUNDLE BRANCH BLOCK VENTRICULAR TACHYCARDIA', :synonyms => 'Idiopathic right bundle branch block ventricular tachycardia', :definition => 'Idiopathic ventricular tachycardia (VT) is a type of ventricular tachycardia occurring unrelated to any organic cardiac disease. The abnormality is probably congenital, be it a focus of abnormal automaticity or myocardial tissue that can sustain re-entry. The clinical presentation for idiopathic VT can be very much like a paroxysmal supraventricular tachycardia. That is, most patients are generally younger without overt cardiac disease and present with paroxysmal palpitations. Idiopathic ventricular tachycardia is not generally life-threatening. (NCI)', :code => 'C71063', :nci_preferred_term => 'Idiopathic Right Bundle Branch Block', :read_only => 'true', :id => '1800', :submission_value => 'IDIOPATHIC RIGHT BUNDLE BRANCH BLOCK VENTRICULAR TACHYCARDIA' },
