  { :sdtm_category_id => '39', :cdisc_preferred_term => 'JTMAX', :synonyms => 'Summary (Max) JT Interval', :definition => 'The maximum duration (time) of the JT interval, obtained from a set of measurements of the JT interval. The JT interval is defined as the time from the J point (end of ventricular depolarization, the point at which the QRS meets the ST segment) to the end of the T wave (representing the end of ventricular repolarization). (NCI)', :code => 'C62117', :nci_preferred_term => 'EKG Maximum JT Duration', :read_only => 'true', :id => '1893', :submission_value => 'Summary (Max) JT Interval' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'JTCB', :synonyms => 'JTcB - Bazett\'s Correction Formula', :definition => 'A formula which takes into account the physiologic shortening of the JT interval which occurs as the heart rate increases, permitting comparison of the JT interval across a range of rates. It is mathematically defined as: JTcB = JT/SqRootRR(seconds) and theoretically corrects the JT interval to that which would be observed at a heart rate of 1 cycle per second. (NCI)', :code => 'C62118', :nci_preferred_term => 'JTcB-Bazett\'s Correction Formula', :read_only => 'true', :id => '1894', :submission_value => 'JTcB - Bazett\'s Correction Formula' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'JTCF', :synonyms => 'JTcF - Fridericia\'s Correction Formula', :definition => 'A formula which takes into account the physiologic shortening of the JT interval which occurs as the heart rate increases, permitting comparison of the JT interval across a range of rates. It is mathematically defined as: JTcF = JT/CubeRootRR(seconds) and theoretically corrects the JT interval to that which would be observed at a heart rate of 1 cycle per second. (NCI)', :code => 'C62119', :nci_preferred_term => 'JTcF-Fridericia\'s Correction Formula', :read_only => 'true', :id => '1895', :submission_value => 'JTcF - Fridericia\'s Correction Formula' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'JTCLC', :synonyms => 'JTcLC - Linear Correction Formula', :definition => 'A formula which takes into account the physiologic shortening of the JT interval which occurs as the heart rate increases, permitting comparison of the JT interval across a range of rates. The linear correction formula uses population-based data obtained and validated using a large cohort of subjects. Using this method, the corrected JT interval is independent of the ventricular rate. (NCI)', :code => 'C62120', :nci_preferred_term => 'JTcLC-Linear Correction Formula', :read_only => 'true', :id => '1896', :submission_value => 'JTcLC - Linear Correction Formula' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'PAXIS', :synonyms => 'Summary (Mean) P Axis', :definition => 'The mean (average) direction (range -180 degrees to 180 degrees) of the electrical potential generated by atrial depolarization in a particular plane (usually the frontal plane). (NCI)', :code => 'C62121', :nci_preferred_term => 'EKG Mean P Axis', :read_only => 'true', :id => '1897', :submission_value => 'Summary (Mean) P Axis' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'PWAVEDUR', :synonyms => 'Summary (Mean) P Wave Duration', :definition => 'The average (mean) duration (time) from the onset of atrial depolarization to the completion of atrial depolarization (length of the P wave), obtained from a set of measurements of the time from beginning to end of atrial depolarization. (NCI)', :code => 'C62123', :nci_preferred_term => 'EKG Mean P Wave Duration', :read_only => 'true', :id => '1898', :submission_value => 'Summary (Mean) P Wave Duration' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'PWAVEHT', :synonyms => 'Summary (Mean) P Wave Height', :definition => 'The average (mean) height (usually measured in mm) of the maximum deflection from baseline of the P wave (representing atrial depolarization), obtained from a set of measurements of the P wave, from a single lead or set of leads. Typically this measurement is obtained by analysis of Lead II. (NCI)', :code => 'C62124', :nci_preferred_term => 'EKG Mean P Wave Height', :read_only => 'true', :id => '1899', :submission_value => 'Summary (Mean) P Wave Height' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'PRMIN', :synonyms => 'Summary (Min) PR Duration', :definition => 'The minimum duration (time) of the PR interval, obtained from a set of measurements of the PR interval. The PR interval is defined as the time from the beginning of the P wave (representing the onset of atrial depolarization) to the beginning of the R wave (representing the onset of ventricular depolarization). In some cases, a Q wave will precede the R wave, in which case the PR interval is measured from the beginning of the P wave to the beginning of the Q wave. (NCI)', :code => 'C62125', :nci_preferred_term => 'EKG Minimum PR Duration', :read_only => 'true', :id => '1900', :submission_value => 'Summary (Min) PR Duration' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'PRMAX', :synonyms => 'Summary (Max) PR Duration', :definition => 'The maximum duration (time) of the PR interval, obtained from a set of measurements of the PR interval. The PR interval is defined as the time from the beginning of the P wave (representing the onset of atrial depolarization) to the beginning of the R wave (representing the onset of ventricular depolarization). In some cases, a Q wave will precede the R wave, in which case the PR interval is measured from the beginning of the P wave to the beginning of the Q wave. (NCI)', :code => 'C62131', :nci_preferred_term => 'EKG Maximum PR Duration', :read_only => 'true', :id => '1901', :submission_value => 'Summary (Max) PR Duration' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'QRSAXIS', :synonyms => 'Summary (Mean) QRS Axis', :definition => 'The mean (average) direction of the electrical potential generated by ventricular depolarization. (NCI)', :code => 'C62132', :nci_preferred_term => 'Mean QRS Axis', :read_only => 'true', :id => '1902', :submission_value => 'Summary (Mean) QRS Axis' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'QTMIN', :synonyms => 'Summary (Min) QT Duration', :definition => 'The minimum duration (time) of the QT interval, obtained from a set of measurements of the QT interval. The QT interval is defined as the time from the beginning of the QRS complex to the end of the T wave, representing the time it takes for the ventricles to depolarize and subsequently repolarize. In some cases, the Q wave will be absent, in which case the QT interval is measured from the beginning of the R wave to the end of the T wave. (NCI)', :code => 'C62133', :nci_preferred_term => 'Minimum QT Duration', :read_only => 'true', :id => '1903', :submission_value => 'Summary (Min) QT Duration' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'QTMAX', :synonyms => 'Summary (Max) QT Duration', :definition => 'The maximum duration (time) of the QT interval, obtained from a set of measurements of the QT interval. The QT interval is defined as the time from the beginning of the QRS complex to the end of the T wave, representing the time it takes for the ventricles to depolarize and subsequently repolarize. In some cases, the Q wave will be absent, in which case the QT interval is measured from the beginning of the R wave to the end of the T wave. (NCI)', :code => 'C62135', :nci_preferred_term => 'EKG Maximum QT Duration', :read_only => 'true', :id => '1904', :submission_value => 'Summary (Max) QT Duration' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'RWAVEAMP', :synonyms => 'Summary (Mean) R Wave Amplitude', :definition => 'The average (mean) amplitude (usually in mm) of the R wave, obtained from a set of measurements of the R wave, in a particular lead or set of leads. (NCI)', :code => 'C62136', :nci_preferred_term => 'EKG Mean R Wave Amplitude', :read_only => 'true', :id => '1905', :submission_value => 'Summary (Mean) R Wave Amplitude' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'SWAVEAMP', :synonyms => 'Summary (Mean) S Wave Amplitude', :definition => 'The average (mean) amplitude (usually in mm) of the S wave, obtained from a set of measurements of the S wave, in a particular lead or set of leads. (NCI)', :code => 'C62137', :nci_preferred_term => 'EKG Mean S Wave Amplitude', :read_only => 'true', :id => '1906', :submission_value => 'Summary (Mean) S Wave Amplitude' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'RSAMP', :synonyms => 'Summary (Mean) R+S Amplitude', :definition => 'The average (mean) amplitude (usually in mm) of the summation of the R and S waves, obtained from a set of measurements of the R and S waves, in a particular lead or set of leads. (NCI)', :code => 'C62144', :nci_preferred_term => 'EKG Mean R+S Amplitude', :read_only => 'true', :id => '1907', :submission_value => 'Summary (Mean) R+S Amplitude' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'STSEGDUR', :synonyms => 'Summary (Mean) ST Segment Duration', :definition => 'The average (mean) duration (time) from the end of ventricular depolarization (end of QRS complex) to the end of ventricular repolarization (end of the T wave). (NCI)', :code => 'C62145', :nci_preferred_term => 'EKG Mean ST Segment Duration', :read_only => 'true', :id => '1908', :submission_value => 'Summary (Mean) ST Segment Duration' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'TAXIS', :synonyms => 'Summary (Mean) T Wave Axis', :definition => 'The mean (average) direction of the electrical potential generated by ventricular repolarization. (NCI)', :code => 'C62146', :nci_preferred_term => 'EKG Mean T Wave Axis', :read_only => 'true', :id => '1909', :submission_value => 'Summary (Mean) T Wave Axis' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'TWAVEDUR', :synonyms => 'Summary (Mean) T Wave Duration', :definition => 'The average (mean) duration (time) from the onset of ventricular repolarization to the completion of ventricular repolarization (length of the T wave), obtained from a set of measurements of the time from beginning to end of ventricular repolarization. (NCI)', :code => 'C62147', :nci_preferred_term => 'EKG Mean T Wave Duration', :read_only => 'true', :id => '1910', :submission_value => 'Summary (Mean) T Wave Duration' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'TWAVAREA', :synonyms => 'Summary (Mean) T Wave Area', :definition => 'The average (mean) area under the curve of the deflection from baseline of the T wave (representing ventricular repolarization), obtained from a set of measurements of the T wave, from a single lead or set of leads. (NCI)', :code => 'C62148', :nci_preferred_term => 'EKG Mean T Wave Area', :read_only => 'true', :id => '1911', :submission_value => 'Summary (Mean) T Wave Area' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'TWAVEHT', :synonyms => 'Summary (Mean) T Wave Height', :definition => 'The average (mean) height (usually measured in mm) of the maximum deflection from baseline of the T wave (representing ventricular repolarization), obtained from a set of measurements of the T wave, from a single lead or set of leads. (NCI)', :code => 'C62149', :nci_preferred_term => 'EKG Mean T Wave Height', :read_only => 'true', :id => '1912', :submission_value => 'Summary (Mean) T Wave Height' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'VRMEAN', :synonyms => 'Summary (Mean) Ventricular Rate', :definition => 'The average (mean) number of cycles of contraction and subsequent relaxation of the ventricles, usually expressed as beats per minute, obtained from a set of measurements of the ventricular rate. (NCI)', :code => 'C62152', :nci_preferred_term => 'Mean Ventricular Heart Rate', :read_only => 'true', :id => '1913', :submission_value => 'Summary (Mean) Ventricular Rate' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'VRMIN', :synonyms => 'Summary (Min) Ventricular Rate', :definition => 'The minimum time between successive cycles of contraction and subsequent relaxation of the ventricles, usually expressed as beats per minute, obtained from a set of measurements of the ventricular rate. (NCI)', :code => 'C62153', :nci_preferred_term => 'Minimum Ventricular Heart Rate', :read_only => 'true', :id => '1914', :submission_value => 'Summary (Min) Ventricular Rate' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'VRMAX', :synonyms => 'Summary (Max) Ventricular Rate', :definition => 'The maximum time between successive cycles of contraction and subsequent relaxation of the ventricles, usually expressed as beats per minute, obtained from a set of measurements of the ventricular rate. (NCI)', :code => 'C62154', :nci_preferred_term => 'Maximum Ventricular Heart Rate', :read_only => 'true', :id => '1915', :submission_value => 'Summary (Max) Ventricular Rate' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'STDVMEAN', :synonyms => 'Summary (Mean) ST Deviation', :definition => 'The average (mean) deviation (distance from baseline, positive or negative, usually measured in mm) of the ST segment, obtained from a set of measurements of the deviation of the ST segment. (NCI)', :code => 'C62155', :nci_preferred_term => 'EKG Mean ST Deviation', :read_only => 'true', :id => '1916', :submission_value => 'Summary (Mean) ST Deviation' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'STDVMIN', :synonyms => 'Summary (Min) ST Deviation', :definition => 'The minimum deviation (distance from baseline, positive or negative, usually measured in mm) of the ST segment, obtained from a set of measurements of the deviation of the ST segment. (NCI)', :code => 'C62156', :nci_preferred_term => 'EKG Minimum ST Deviation', :read_only => 'true', :id => '1917', :submission_value => 'Summary (Min) ST Deviation' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'STDVMAX', :synonyms => 'Summary (Max) ST Deviation', :definition => 'The maximum deviation (distance from baseline, positive or negative, usually measured in mm) of the ST segment, obtained from a set of measurements of the deviation of the ST segment. (NCI)', :code => 'C62157', :nci_preferred_term => 'EKG Maximum ST Deviation', :read_only => 'true', :id => '1918', :submission_value => 'Summary (Max) ST Deviation' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'STELMEAN', :synonyms => 'Summary (Mean) ST Elevation', :definition => 'The average (mean) elevation (positive deflection from baseline, usually measured in mm) of the ST segment, obtained from a set of measurements of the elevation of the ST segment. (NCI)', :code => 'C62158', :nci_preferred_term => 'EKG Mean ST Segment Elevation', :read_only => 'true', :id => '1919', :submission_value => 'Summary (Mean) ST Elevation' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'STELMIN', :synonyms => 'Summary (Min) ST Elevation', :definition => 'The minimum elevation (positive deflection from baseline, usually measured in mm) of the ST segment, obtained from a set of measurements of the elevation of the ST segment. (NCI)', :code => 'C62159', :nci_preferred_term => 'EKG Minimum ST Segment Elevation', :read_only => 'true', :id => '1920', :submission_value => 'Summary (Min) ST Elevation' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'STELMAX', :synonyms => 'Summary (Max) ST Elevation', :definition => 'The maximum elevation (positive deflection from baseline, usually measured in mm) of the ST segment, obtained from a set of measurements of the elevation of the ST segment. (NCI)', :code => 'C62160', :nci_preferred_term => 'EKG Maximum ST Segment Elevation', :read_only => 'true', :id => '1921', :submission_value => 'Summary (Max) ST Elevation' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'STDPMEAN', :synonyms => 'Summary (Mean) ST Depression', :definition => 'The average (mean) depression (negative deflection from baseline, usually measured in mm) of the ST segment, obtained from a set of measurements of the depression of the ST segment. (NCI)', :code => 'C62161', :nci_preferred_term => 'EKG Mean ST Segment Depression', :read_only => 'true', :id => '1922', :submission_value => 'Summary (Mean) ST Depression' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'STDPMIN', :synonyms => 'Summary (Min) ST Depression', :definition => 'The minimum depression (negative deflection from baseline, usually measured in mm) of the ST segment, obtained from a set of measurements of the depression of the ST segment. (NCI)', :code => 'C62162', :nci_preferred_term => 'EKG Minimum ST Segment Depression', :read_only => 'true', :id => '1923', :submission_value => 'Summary (Min) ST Depression' },
  { :sdtm_category_id => '39', :cdisc_preferred_term => 'STDPMAX', :synonyms => 'Summary (Max) ST Depression', :definition => 'The maximum depression (negative deflection from baseline, usually measured in mm) of the ST segment, obtained from a set of measurements of the depression of the ST segment. (NCI)', :code => 'C62163', :nci_preferred_term => 'EKG Maximum ST Segment Depression', :read_only => 'true', :id => '1924', :submission_value => 'Summary (Max) ST Depression' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => '12 LEAD UNSPECIFIED', :synonyms => '12 Lead Unspecified', :definition => 'An electrocardiogram (ECG) lead placement whereby 12 leadpoints are recorded but the position of the leads is unspecified. (NCI)', :code => 'C71101', :nci_preferred_term => '12 Lead Placement Unspecified', :read_only => 'true', :id => '1926', :submission_value => '12 LEAD UNSPECIFIED' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => '12 LEAD STANDARD', :synonyms => '12 Lead Standard', :definition => 'An electrocardiogram (ECG) lead placement whereby 12 leads are recorded, with each lead representing an electrical view of the heart. The six leads recorded in the frontal plane are derived from the placement of 3 electrodes (RA or Right Arm, LA, or Left Arm, and LL or Left Leg). These bipolar frontal leads form the basis of Einthoven\'s triangle, and are represented by leads I, II, and III. Three other derived (or augmented) bipolar frontal vectors are also recorded on a standard 12-lead EKG, aVR, aVF, and aVL. 6 unipolar leads, corresponding to V1 - V6 measure the electrical activity in the horizontal plane. The placement for the V leads is as follows: V1: right 4th intercostal space,V2: left 4th intercostal space, V3: halfway between V2 and V4, V4: left 5th intercostal space, mid-clavicular line, V5: horizontal to V4, anterior axillary line, V6: horizontal to V5, mid-axillary line. (NCI)', :code => 'C71102', :nci_preferred_term => '12 Lead Placement Standard', :read_only => 'true', :id => '1927', :submission_value => '12 LEAD STANDARD' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => '12 LEAD MASON LIKAR', :synonyms => '12 Lead Mason Likar', :definition => 'An electrocardiogram (ECG) lead placement whereby 12 leadpoints are recorded but the standard lead positions have been modified for ECG recording during exercise. Exercise stress testing requires moving the limb electrodes to more central positions on the thorax. The electrodes are placed in bony prominences close to the bases of the respective limbs in order to avoid skeletal muscle artifact, provide stability for recording electrodes and to record waveforms similar to the standard limb sites. (NCI)', :code => 'C71103', :nci_preferred_term => '12 Lead Placement Mason Likar', :read_only => 'true', :id => '1928', :submission_value => '12 LEAD MASON LIKAR' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => '12 LEAD MODIFIED MASON LIKAR', :synonyms => '12 Lead Modified Mason Likar', :definition => 'An electrocardiogram (ECG) lead placement whereby 12 leadpoints are recorded but the Mason Likar lead positions have been modified so that V1 to V6 on the chest are part of a single electrode pad. In addition, lead CM5 is substituted for lead aVR. (NCI)', :code => 'C71110', :nci_preferred_term => '12 Lead Placement Mason Likar Modified', :read_only => 'true', :id => '1929', :submission_value => '12 LEAD MODIFIED MASON LIKAR' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => '12 LEAD SINGLE PAD', :synonyms => '12 Lead Single Pad', :definition => 'An electrocardiogram (ECG) lead placement whereby 12 leadpoints are recorded but the standard lead positions have been modified so that all leads on the chest are part of a single electrode pad. (NCI)', :code => 'C71112', :nci_preferred_term => '12 Lead Placement Chest', :read_only => 'true', :id => '1930', :submission_value => '12 LEAD SINGLE PAD' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => '12 LEAD NON-STANDARD', :synonyms => '12 Lead Non-Standard', :definition => 'An electrocardiogram (ECG) lead placement whereby the limb leads are placed on the torso for easier and faster application in emergency situations. (NCI)', :code => 'C71114', :nci_preferred_term => '12 Lead Placement Non-Standard', :read_only => 'true', :id => '1931', :submission_value => '12 LEAD NON-STANDARD' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => 'STANDARD LEADS FOR BICYCLE EXERCISE', :synonyms => 'Standard leads for bicycle exercise. Limb leads on the back (shoulder and on the hips)', :definition => 'Limb leads on the back (shoulder and on the hips). (NCI)', :code => 'C71115', :nci_preferred_term => 'Lead Placement Bicycle', :read_only => 'true', :id => '1932', :submission_value => 'STANDARD LEADS FOR BICYCLE EXERCISE' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => '12 LEAD CABRERA', :synonyms => '12 Lead Cabrera', :definition => 'An electrocardiogram (ECG) lead placement whereby the display of the 12 standard ECG leads is in an orderly sequence in a single horizontal display of: aVL, I, -aVR, II, aVF, III, V1 to V6. In the Cabrera display the limb lead aVR is inverted (-aVR) to obtain the same positive leftward orientation as the other 5 limbs. (NCI)', :code => 'C71116', :nci_preferred_term => '12 Lead Placement Cabrera', :read_only => 'true', :id => '1933', :submission_value => '12 LEAD CABRERA' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => 'STANDARD LEADS ONE INTERCOSTAL SPACE HIGHER', :synonyms => 'Standard leads one intercostal space higher', :definition => 'An electrocardiographic lead placement schema in which the V leads are placed one intercostal space cephalad to the position they would have in the standard lead placement schema. (NCI)', :code => 'C71117', :nci_preferred_term => 'Lead Placement Standard Intercostal Space Higher', :read_only => 'true', :id => '1934', :submission_value => 'STANDARD LEADS ONE INTERCOSTAL SPACE HIGHER' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => 'FRANK LEAD SYSTEM', :synonyms => 'Frank lead system', :definition => 'An electrocardiogram (ECG) lead placement for determining 3 orthogonal components X (right to left direction), Y (foot to head direction) and Z (back to front direction) of the heart. For this method a minimum of 4 electrodes are needed that represent the right arm, left arm, left leg and back. However, usually 7 electrodes are used to avoid dependence on the dipole location and facilitate interpretation. (NCI)', :code => 'C71118', :nci_preferred_term => 'Lead Placement Frank', :read_only => 'true', :id => '1935', :submission_value => 'FRANK LEAD SYSTEM' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => 'MCFEE-PARUNGAO LEAD SYSTEM', :synonyms => 'McFee-Parungao lead system', :definition => 'An electrocardiogram (ECG) lead placement for determining 3 orthogonal components X (back to front), Y (right to left) and Z (foot to head) of the heart. This system places the electrodes closer to the heart to achieve better orthogonality and a homogeneous lead field. (NCI)', :code => 'C71119', :nci_preferred_term => 'Lead Placement McFee-Parungao', :read_only => 'true', :id => '1936', :submission_value => 'MCFEE-PARUNGAO LEAD SYSTEM' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => 'CUBE LEAD SYSTEM', :synonyms => 'Cube lead system', :definition => 'An electrocardiogram (ECG) lead placement that is a type of uncorrected vectorcardiograph. This lead system is based on a rectangular body axis. It uses an extra number of electrodes to make it three-dimensional. (NCI)', :code => 'C71120', :nci_preferred_term => 'Lead Placement Cube', :read_only => 'true', :id => '1937', :submission_value => 'CUBE LEAD SYSTEM' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => 'BIPOLAR UNCORRECTED XYZ LEAD SYSTEM', :synonyms => 'Bipolar uncorrected XYZ lead system', :definition => 'An electrocardiogram (ECG) lead placement whereby the X+ lead is placed at the right mid-axillary line ate the 4th intercostal space, X- at the left mid-axillary line at he 4th intercostal space, Y+ at the proximal left leg, Y- at the superior aspect of the manubrium, Z+ at the direct posterior to Z- and Z- at the 4th intercostal space at the left sternal margin. (NCI)', :code => 'C71121', :nci_preferred_term => 'Lead Placement Bipolar Uncorrected XYZ', :read_only => 'true', :id => '1938', :submission_value => 'BIPOLAR UNCORRECTED XYZ LEAD SYSTEM' },
  { :sdtm_category_id => '40', :cdisc_preferred_term => 'PSEUDO-ORTHOGONAL XYZ LEAD SYSTEM', :synonyms => 'Pseudo-orthogonal XYZ lead system', :definition => 'An electrocardiogram (ECG) lead placement that allows monitoring and recording of cardiac electrical activity. A V1-type lead is used whose positive electrode is localized in the 4th intercostal space, 2.5cm from the sternum. Its negative electrode is placed below the left clavicle. An addition of lead V5 and aVF can be made to facilitate interpretation. (NCI)', :code => 'C71122', :nci_preferred_term => 'Lead Placement Pseudo Orthogonal XYZ', :read_only => 'true', :id => '1939', :submission_value => 'PSEUDO-ORTHOGONAL XYZ LEAD SYSTEM' },
