  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Gy', :synonyms => 'Gray', :definition => 'A unit of absorbed radiation dose. One gray is equal to an absorbed dose of one joule per kilogram of matter, or to 100 rads.(NCI)', :code => 'C18063', :nci_preferred_term => 'Gray', :read_only => 'true', :id => '1949', :submission_value => 'Gy' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Rad', :synonyms => 'Rad', :definition => 'The special unit for absorbed radiation dose, which is the amount of energy from any type of ionizing radiation (e.g., alpha, beta, gamma, neutrons, etc.) deposited in any medium (e.g., water, tissue, air). A dose of one rad means the absorption of 100 ergs per gram of absorbing tissue. One rad is equal to 0.01 gray.(NCI)', :code => 'C18064', :nci_preferred_term => 'Rad', :read_only => 'true', :id => '1950', :submission_value => 'Rad' },
