  { :sdtm_category_id => '41', :cdisc_preferred_term => 'mm', :synonyms => 'Millimeter', :definition => 'A unit of measure equal to one thousandth of a meter.(NCI)', :code => 'C28251', :nci_preferred_term => 'Millimeter', :read_only => 'true', :id => '1954', :submission_value => 'mm' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'kg', :synonyms => 'Kilogram', :definition => 'The basic SI unit of mass. It is defined as the mass of an international prototype in the form of a platinum-iridium cylinder kept at Sevres in France. It is the only basic unit still defined in terms of a material object, and also the only one with a prefix [kilo] already in place. A kilogram is equal to 1,000 grams and 2.204 622 6 pounds. (NCI)', :code => 'C28252', :nci_preferred_term => 'Kilogram', :read_only => 'true', :id => '1955', :submission_value => 'kg' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'mg', :synonyms => 'Milligram', :definition => 'The unit of mass equal to one thousandth of a gram or 1000 micrograms. One milligram equals approximately 0.015432 grain or 35.274 x 10E-6 ounce.(NCI)', :code => 'C28253', :nci_preferred_term => 'Milligram', :read_only => 'true', :id => '1956', :submission_value => 'mg' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'mL', :synonyms => 'Milliliter', :definition => 'The unit of volume equal to one thousandth of a liter, one cubic centimeter, 10E-6 cubic meter, or approximately to 0.061 023 7 cubic inch.(NCI)', :code => 'C28254', :nci_preferred_term => 'Milliliter', :read_only => 'true', :id => '1957', :submission_value => 'mL' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'WEEKS', :synonyms => 'Week', :definition => 'Any period of seven consecutive days.(NCI)', :code => 'C29844', :nci_preferred_term => 'Week', :read_only => 'true', :id => '1958', :submission_value => 'WEEKS' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'MONTHS', :synonyms => 'Month', :definition => 'One of the 12 divisions of a year as determined by a calendar. It corresponds to the unit of time of approximately to one cycle of the moon\'s phases, about 30 days or 4 weeks.(NCI)', :code => 'C29846', :nci_preferred_term => 'Month', :read_only => 'true', :id => '1959', :submission_value => 'MONTHS' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'YEARS', :synonyms => 'Year', :definition => 'The period of time that it takes for earth to make a complete revolution around the sun, approximately 365 days; a specific one year period.(NCI)', :code => 'C29848', :nci_preferred_term => 'Year', :read_only => 'true', :id => '1960', :submission_value => 'YEARS' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'm', :synonyms => 'Meter', :definition => 'A meter is defined as the length of the path traveled by light in a vacuum during a time interval of 1/299 792 458 of a second and is equal to 1.093 61 yards.(NCI)', :code => 'C41139', :nci_preferred_term => 'Meter', :read_only => 'true', :id => '1961', :submission_value => 'm' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'msec', :synonyms => 'Millisecond', :definition => 'A unit of time, which is equal to one thousandth of a second.(NCI)', :code => 'C41140', :nci_preferred_term => 'Millisecond', :read_only => 'true', :id => '1962', :submission_value => 'msec' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'sec', :synonyms => 'Second', :definition => 'The second is a unit of time with a duration of 919 263 177 0 periods of the specified light radiation corresponding to the transition between the two hyperfine levels of the cesium 133 atom in its ground state at 0 K. According to the convention, 60 seconds constitute one minute; 3,600 seconds constitute one hour. Abbreviation Sec. is acceptable in non-scientific usage only.(NCI)', :code => 'C42535', :nci_preferred_term => 'Second', :read_only => 'true', :id => '1963', :submission_value => 'sec' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'amp', :synonyms => 'Ampere', :definition => 'A unit of electric current, named after the French physicist Andre Ampere. It is that constant current which, if maintained in two straight parallel conductors of infinite length and zero diameter separated by one meter in a vacuum, would produce between these conductors a force equal to 2(10E7) Newton per meter of length. This is dependent upon the definitions of the meter, kilogram, and second. One Ampere represents 6.24 x 10(E18) unit electric charge carriers, such as electrons, passing a specified fixed point in one second.(NCI)', :code => 'C42536', :nci_preferred_term => 'Ampere', :read_only => 'true', :id => '1964', :submission_value => 'amp' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'cd', :synonyms => 'Candela', :definition => 'The candela is the basic unit of luminous intensity. It is the luminous intensity in a given direction of a small monochromatic light source at 540 terahertz emitting 1/683 watt per steradian in that direction. This is dependent upon the definitions of the meter, kilogram, and second.(NCI)', :code => 'C42538', :nci_preferred_term => 'Candela', :read_only => 'true', :id => '1965', :submission_value => 'cd' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'mol', :synonyms => 'Mole', :definition => 'A unit defined as the amount of substance that contains as many elementary units as there are atoms in 0.012 kg of carbon-12. When the mole is used, the elementary entities must be specified and may be atoms, molecules, ions, electrons, other particles, or specified groups of such particles.(NCI)', :code => 'C42539', :nci_preferred_term => 'Mole', :read_only => 'true', :id => '1966', :submission_value => 'mol' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Hz', :synonyms => 'Hertz', :definition => 'A unit of frequency equal to one cycle per second.(NCI)', :code => 'C42545', :nci_preferred_term => 'Hertz', :read_only => 'true', :id => '1967', :submission_value => 'Hz' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Newton', :synonyms => 'Newton', :definition => 'A unit of force which, when applied in a vacuum to a body having a mass of one kilogram, causes an acceleration of one meter per second squared. It is equal to 10E5 dynes.(NCI)', :code => 'C42546', :nci_preferred_term => 'Newton', :read_only => 'true', :id => '1968', :submission_value => 'Newton' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Pa', :synonyms => 'Pascal', :definition => 'A unit of pressure equivalent to one Newton per square meter or 10 bars or to 1.45x10(E-4) pounds per square inch.(NCI)', :code => 'C42547', :nci_preferred_term => 'Pascal', :read_only => 'true', :id => '1969', :submission_value => 'Pa' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Joule', :synonyms => 'Joule', :definition => 'A unit of electrical, mechanical, and thermal energy (as well as work and quantity of heat), equal to the work done when the point of application of a force of one Newton is displaced through a distance of one meter in the direction of the force or the work done when a current of one Ampere passes through a resistance of one ohm for one second. One joule is equal to 0.23889 gram-calorie (mean).(NCI)', :code => 'C42548', :nci_preferred_term => 'Joule', :read_only => 'true', :id => '1970', :submission_value => 'Joule' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Watt', :synonyms => 'Watt', :definition => 'A unit of power equal to the power which in one second produces or transfers the energy of one joule. The unit is used in measurements of power emitted, transferred or received as radiation, sound waves, heat flow rate, and rate of energy transfer. Equal to 1/746 of horsepower.(NCI)', :code => 'C42549', :nci_preferred_term => 'Watt', :read_only => 'true', :id => '1971', :submission_value => 'Watt' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Coulomb', :synonyms => 'Coulomb', :definition => 'A unit of quantity of electricity, equal to the quantity of charge transferred in one second across a conductor in which there is a constant current of one Ampere.(NCI)', :code => 'C42550', :nci_preferred_term => 'Coulomb', :read_only => 'true', :id => '1972', :submission_value => 'Coulomb' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'V', :synonyms => 'Volt', :definition => 'A unit of electric potential and electromotive force, equal to the difference of electric potential between two points on a conducting wire carrying a constant current of one Ampere when the power dissipated between the points is one watt. This is equivalent to the potential difference across a resistance of one ohm when one Ampere of current flows through it.(NCI)', :code => 'C42551', :nci_preferred_term => 'Volt', :read_only => 'true', :id => '1973', :submission_value => 'V' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Farad', :synonyms => 'Farad', :definition => 'A unit of capacitance equal to the capacitance of a capacitor having an equal and opposite charge of one coulomb on each plate and a potential difference of one volt between the plates.(NCI)', :code => 'C42552', :nci_preferred_term => 'Farad', :read_only => 'true', :id => '1974', :submission_value => 'Farad' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Sv', :synonyms => 'Sievert', :definition => 'A unit of equivalent radiation dose. One Sv is received when the actual absorbed dose of ionizing radiation, after being multiplied by the dimensionless factors Q (the relative biological efficiency or quality factor) and N (the product of any other multiplying factors that takes into account the distribution of energy throughout the dose), is one joule per kilogram. In this scheme, the relationship between the absorbed dose of radiation D and the dose equivalent H is, therefore, given by H = QND. Both Q and N are stipulated by the International Commission on Radiological Protection. One Sv is equal to 100 rem.(NCI)', :code => 'C42553', :nci_preferred_term => 'Sievert', :read_only => 'true', :id => '1975', :submission_value => 'Sv' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'ohm', :synonyms => 'Ohm', :definition => 'A unit of electrical resistance equal to the resistance between two points on a conductor when a potential difference of one volt between them produces a current of one Ampere. Ohm is also used to measure impedance and reactance for complex resistance. A measurement in ohms is the reciprocal of a measurement in Siemens.(NCI)', :code => 'C42554', :nci_preferred_term => 'Ohm', :read_only => 'true', :id => '1976', :submission_value => 'ohm' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Siemens', :synonyms => 'Siemens', :definition => 'A unit of electrical conductance, admittance, and susceptance. A conductor has a conductance of one Siemens if an electrical potential difference of one volt produces a one Ampere current in it. The conductance in Siemens is the reciprocal of its resistance in ohms.(NCI)', :code => 'C42555', :nci_preferred_term => 'Siemens', :read_only => 'true', :id => '1977', :submission_value => 'Siemens' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Weber', :synonyms => 'Weber', :definition => 'A unit of magnetic flux, equal to the flux that produces in a circuit of one turn an electromotive force of one volt, when the flux is uniformly reduced to zero within one second.(NCI)', :code => 'C42556', :nci_preferred_term => 'Weber', :read_only => 'true', :id => '1978', :submission_value => 'Weber' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Tesla', :synonyms => 'Tesla', :definition => 'A unit of magnetic flux density equal to the magnitude of the magnetic field vector necessary to produce a force of one Newton on a charge of one coulomb moving perpendicular to the direction of the magnetic field vector with a velocity of one meter per second. It is equivalent to one Weber per square meter.(NCI)', :code => 'C42557', :nci_preferred_term => 'Tesla', :read_only => 'true', :id => '1979', :submission_value => 'Tesla' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Henry', :synonyms => 'Henry', :definition => 'A unit of electric inductance. A coil with an inductance of one Henry requires a flux of one Weber for each Ampere of induced current. If it is the current which changes, then the induced field will generate a potential difference within the coil: if the inductance is one Henry a current change of one Ampere per second generates a potential difference of one volt. The Henry is a large unit; inductances in practical circuits are measured in millihenrys or microhenrys.(NCI)', :code => 'C42558', :nci_preferred_term => 'Henry', :read_only => 'true', :id => '1980', :submission_value => 'Henry' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'C', :synonyms => 'Degree Celsius', :definition => 'A unit of temperature, named after the Swedish astronomer Anders Celsius, who first proposed the temperature scale designed so that the freezing point of water is 0 degrees and the boiling point is 100 degrees at standard atmospheric pressure. The current official definition of the Celsius sets 0.01 C to be at the triple point of water and a degree to be 1/273.16 of the difference in temperature between the triple point of water and absolute zero. One degree Celsius represents the same temperature difference as one Kelvin.(NCI)', :code => 'C42559', :nci_preferred_term => 'Degree Celsius', :read_only => 'true', :id => '1981', :submission_value => 'C' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'lm', :synonyms => 'Lumen', :definition => 'A unit of luminous flux. It is the amount of light that falls on a unit area at unit distance from a source of one candela.(NCI)', :code => 'C42560', :nci_preferred_term => 'Lumen', :read_only => 'true', :id => '1982', :submission_value => 'lm' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'lx', :synonyms => 'Lux', :definition => 'A unit of illuminance equal to the direct illumination on a surface that is everywhere one meter from a uniform point source of one candela; a unit of illuminance that is equal to one lumen per square meter.(NCI)', :code => 'C42561', :nci_preferred_term => 'Lux', :read_only => 'true', :id => '1983', :submission_value => 'lx' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'Bq', :synonyms => 'Becquerel', :definition => 'A unit of activity of a radionuclide, equal to one nuclear disintegration or other nuclear transition from a particular energy state occurring in an amount of a radionuclide during one second-long time interval.(NCI)', :code => 'C42562', :nci_preferred_term => 'Becquerel', :read_only => 'true', :id => '1984', :submission_value => 'Bq' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'kat', :synonyms => 'Katal', :definition => 'A unit for measuring catalytic (e.g. enzymatic) activity, the ability of the compound to accelerate the chemical reaction by providing a lower energy pathway between the reactants and the products. One katal is that catalytic activity which will raise the rate of reaction by one mole per second in a specified assay system. When the katal is used, the measurand should be specified by reference to the measurement procedure; the measurement procedure must identify the indicator reaction. The katal is not used to express a rate of reaction itself, which should be expressed in moles per second.(NCI)', :code => 'C42566', :nci_preferred_term => 'Katal', :read_only => 'true', :id => '1985', :submission_value => 'kat' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'm2', :synonyms => 'Square Meter', :definition => 'The SI unit of area measurement equal to a square whose sides are one meter long. Square meter is equal to 10,000 square centimeters; 0.01 are; 1.196 square yards; 10.76 square feet; 1550 square inches. (NCI)', :code => 'C42569', :nci_preferred_term => 'Square Meter', :read_only => 'true', :id => '1986', :submission_value => 'm2' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'm3', :synonyms => 'Cubic Meter', :definition => 'A unit of volume or capacity equal to the volume of a cube with edges one meter in length. It is equal to 1,000 liters; 1,000 cubic decimeters; 10(E6) cubic centimeters; 25.3 cubic feet; 6.29 barrels.(NCI)', :code => 'C42570', :nci_preferred_term => 'Cubic Meter', :read_only => 'true', :id => '1987', :submission_value => 'm3' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'm/sec', :synonyms => 'Meter Per Second', :definition => 'A unit of both speed (scalar) and velocity (vector), defined as the distance of one meter travelled per unit time equal to one second.(NCI)', :code => 'C42571', :nci_preferred_term => 'Meter Per Second', :read_only => 'true', :id => '1988', :submission_value => 'm/sec' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'kg/m3', :synonyms => 'Kilogram per Cubic Meter; g/L; Gram per Liter; ug/uL; Microgram per Microliter; Milligram per Milliliter', :definition => 'A unit of mass concentration defined as the concentration of one kilogram of a substance per unit volume of the mixture equal to one cubic meter, or the concentration of one milligram of a substance per unit volume of the mixture equal to one milliliter, or one gram of a substance per one liter of the mixture. It is also a unit of mass density (volumic mass) defined as the density of substance which mass equal to one milligram occupies the volume one milliliter.(NCI)', :code => 'C42576', :nci_preferred_term => 'Kilogram per Cubic Meter', :read_only => 'true', :id => '1989', :submission_value => 'kg/m3' },
