  { :sdtm_category_id => '41', :cdisc_preferred_term => 'QUANTITY SUFFICIENT', :synonyms => 'Quantity Sufficient', :definition => 'A quantity of an ingredient or product needed to bring up a volume or weight of the preparation to a final amount as it is indicated in the prescription; also refers to a determination of an adequate supply of medicine to fulfill either a prescribed amount or a sufficient quantity to provide treatment over a specified time frame.(NCI)', :code => 'C48590', :nci_preferred_term => 'Quantity Sufficient', :read_only => 'true', :id => '2059', :submission_value => 'QUANTITY SUFFICIENT' },
