  { :sdtm_category_id => '41', :cdisc_preferred_term => 'atm', :synonyms => 'Atmosphere', :definition => 'A unit of pressure, equal to a barometer reading of 760 mm Hg. 1 atmosphere is 101325 Pascals and 1.01325 bar. This unit of pressure is roughly equal to the average atmospheric pressure at sea level on the earth.(NCI)', :code => 'C54711', :nci_preferred_term => 'Atmosphere', :read_only => 'true', :id => '2066', :submission_value => 'atm' },
