  { :sdtm_category_id => '41', :cdisc_preferred_term => 'cg', :synonyms => 'Centigram', :definition => 'A unit of mass equal to one hundredth of a gram.(NCI)', :code => 'C64554', :nci_preferred_term => 'Centigram', :read_only => 'true', :id => '2072', :submission_value => 'cg' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'dram', :synonyms => 'Dram', :definition => 'A unit of mass equal to 1/16 Avoirdupois ounce or 1/256 Avoirdupois pound. One dram equals approximately 1.7718451953125 grams.(NCI)', :code => 'C64564', :nci_preferred_term => 'Dram Mass Unit', :read_only => 'true', :id => '2073', :submission_value => 'dram' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'kg/L', :synonyms => 'Kilogram per Liter; g/mL; Gram per Milliliter', :definition => 'A unit of mass concentration defined as the concentration of one kilogram of a substance in unit volume of the mixture equal to one liter. The concept also refers to the unit of mass density (volumic mass) defined as the density of substance which mass equal to one kilogram occupies the volume one liter.(NCI)', :code => 'C64566', :nci_preferred_term => 'Kilogram per Liter', :read_only => 'true', :id => '2074', :submission_value => 'kg/L' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'g/m3', :synonyms => 'Gram per Cubic Meter; ug/mL; Microgram per Milliliter; mg/L; Milligram per Liter', :definition => 'A unit of mass concentration equal to the concentration of one gram of a substance per unit volume of the mixture equal to one cubic meter. The concept also refers to the metric unit of mass density (volumic mass) defined as the density of substance which mass equal to one gram occupies the volume one cubic meter.(NCI)', :code => 'C64572', :nci_preferred_term => 'Microgram per Milliliter', :read_only => 'true', :id => '2075', :submission_value => 'g/m3' },
