  { :sdtm_category_id => '41', :cdisc_preferred_term => 'g/dL', :synonyms => 'Gram per Deciliter', :definition => 'A unit of mass concentration defined as the concentration of one gram of a substance per unit volume of the mixture equal to one deciliter (100 milliliters). The concept also refers to the metric unit of mass density (volumic mass) defined as the density of substance which mass equal to one gram occupies the volume one deciliter.(NCI)', :code => 'C64783', :nci_preferred_term => 'Gram per Deciliter', :read_only => 'true', :id => '2077', :submission_value => 'g/dL' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'pmol', :synonyms => 'Picomole', :definition => 'A unit of amount of substance equal to a trillionth (10E-12) of a mole.(NCI)', :code => 'C65045', :nci_preferred_term => 'Picomole', :read_only => 'true', :id => '2078', :submission_value => 'pmol' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'PUFF', :synonyms => 'Puff', :definition => 'A means of delivering a defined dose of a therapeutic aerolized solution into either the upper or lower respiratory tract. Metered-dose inhalers or spray pumps are devices that provide a puff dose for delivery into either the oral or the nasal cavity.(NCI)', :code => 'C65060', :nci_preferred_term => 'Puff Dosing Unit', :read_only => 'true', :id => '2079', :submission_value => 'PUFF' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'mm2', :synonyms => 'Square Millimeter', :definition => 'A unit of area measurement equal to a square measuring one millimeter on each side. One square millimeter is equal to 10(E-2) square centimeter and 10(E-6) square meter.(NCI)', :code => 'C65104', :nci_preferred_term => 'Square Millimeter', :read_only => 'true', :id => '2080', :submission_value => 'mm2' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'tuberculin unit', :synonyms => 'Tuberculin Unit', :definition => 'An arbitrary unit of tuberculin dosage defined by comparison of clinical response with a preparation of the purified protein derivative standardized for use in humans for tuberculin skin test reaction.(NCI)', :code => 'C65132', :nci_preferred_term => 'Tuberculin Unit', :read_only => 'true', :id => '2081', :submission_value => 'tuberculin unit' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'mL/h', :synonyms => 'Milliliters per Hour', :definition => 'A unit of volumetric flow rate defined as the rate at which one milliliter of matter travels during the period of time equal to one hour.(NCI)', :code => 'C66962', :nci_preferred_term => 'Milliliter per Hour', :read_only => 'true', :id => '2082', :submission_value => 'mL/h' },
