  { :sdtm_category_id => '41', :cdisc_preferred_term => 'per min', :synonyms => 'Per Minute', :definition => 'The number of occurrences of something within a minute of time.(NCI)', :code => 'C66967', :nci_preferred_term => 'Per Minute', :read_only => 'true', :id => '2084', :submission_value => 'per min' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'mg/h', :synonyms => 'Milligram per Hour', :definition => 'A unit of mass flow rate equivalent to the rate at which one thousandth of a gram of matter travels to a given object or space over a period of time equal to one hour.(NCI)', :code => 'C66969', :nci_preferred_term => 'Milligram per Hour', :read_only => 'true', :id => '2085', :submission_value => 'mg/h' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'mg/dL', :synonyms => 'Milligram per Deciliter', :definition => 'A unit of mass concentration defined as the concentration of one milligram of a substance in unit volume of the mixture equal to one cubic deciliter or 100 cubic centimeters. It is also a unit of mass density (volumic mass) defined as the density of substance which mass equal to one milligram occupies the volume one cubic deciliter or 100 cubic centimeters.(NCI)', :code => 'C67015', :nci_preferred_term => 'Milligram per Deciliter', :read_only => 'true', :id => '2086', :submission_value => 'mg/dL' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'cal', :synonyms => 'Calorie', :definition => 'A measurement of nutritional energy. The quantity of thermal energy required to raise one gram of water one degree Centigrade under standard conditions. 1 calorie equals 4.186 joules. (NCI)', :code => 'C67193', :nci_preferred_term => 'calorie', :read_only => 'true', :id => '2087', :submission_value => 'cal' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'kcal', :synonyms => 'Kilogram-Calorie', :definition => 'A unit of energy defined as the amount of heat required to raise the temperature of one kilogram of pure water by one degree Centigrade under standard conditions (the specific heat of the water at 15 degrees Celsius and the constant pressure of 101.325 kilopascals or one atm being defined as unity), equal to approximately 4.1855 kJ. It is also is used by nutritionists in measuring the energy-producing potential of food as a unit of potential energy contained by a substance, which can be liberated when the material is oxidized, usually by combustion in the presence of oxygen.(NCI)', :code => 'C67194', :nci_preferred_term => 'Calorie', :read_only => 'true', :id => '2088', :submission_value => 'kcal' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'PFU', :synonyms => 'Plaque Forming Unit', :definition => 'A measure of viable infectious entities (e.g. viral particle or group of particles) in the specimen or product defined as the smallest quantity that can produce a cytopathic effect in the host cell culture challenged with the defined inoculum, visible under the microscope or/and to the naked eye as a plaque. A number of plaque forming units (PFU) per unit volume is a conventional way to refer the titer of an infective entity in a specimen or preparation.(NCI)', :code => 'C67264', :nci_preferred_term => 'Plaque Forming Unit', :read_only => 'true', :id => '2089', :submission_value => 'PFU' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'eq', :synonyms => 'Equivalent Weight', :definition => 'A unit of relative amount of a substance that combines with or displaces 8.0 grams of oxygen or 1.008 gram of hydrogen. The unit is usually expressed in grams and is equal to the amount of substance that gains or loses one mole of electrons in a redox reaction, or to the amount of substances that releases or accepts one mole of hydrogen ions in a neutralization reaction; or to the amount of electrolyte that carries one mole of positive or negative charge. This is a large unit and measurements are more often done in its derivatives, e.g. in milliequivalents.(NCI)', :code => 'C67273', :nci_preferred_term => 'Equivalent Weight', :read_only => 'true', :id => '2090', :submission_value => 'eq' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'HPF', :synonyms => 'High Power Field', :definition => 'The area visible under the maximum magnification power of the objective being used in microscopy.(NCI)', :code => 'C67274', :nci_preferred_term => 'High Power Field', :read_only => 'true', :id => '2091', :submission_value => 'HPF' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'g/m2', :synonyms => 'Gram per Square Meter', :definition => 'A unit of area density defined as a spread rate at which one gram of a substance is spread over the area of one square meter. It is equal to approximately 0.029 4935 ounce per square yard. Also used as a dose calculation unit.(NCI)', :code => 'C67282', :nci_preferred_term => 'Gram per Square Meter', :read_only => 'true', :id => '2092', :submission_value => 'g/m2' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'ug/L', :synonyms => 'Microgram per Liter; mg/m3; Milligram per Cubic Meter; ng/mL; Nanogram per Milliliter; mcg/L', :definition => 'A unit of mass concentration defined as the concentration of one microgram of a substance per unit volume of the mixture equal to one liter. The concept also refers to the unit of mass density (volumic mass) defined as the density of substance which mass equal to one microgram occupies the volume one liter.(NCI)', :code => 'C67306', :nci_preferred_term => 'Microgram per Liter', :read_only => 'true', :id => '2093', :submission_value => 'ug/L' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'LPF', :synonyms => 'Low Power Field', :definition => 'The area visible in one view field of the microscope under the low magnification of the objective being used in microscopy.(NCI)', :code => 'C67307', :nci_preferred_term => 'Low Power Field', :read_only => 'true', :id => '2094', :submission_value => 'LPF' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'mV', :synonyms => 'Millivolt', :definition => 'A unit of electric potential and electromotive force equal to one thousandth of a volt.(NCI)', :code => 'C67324', :nci_preferred_term => 'Millivolt', :read_only => 'true', :id => '2095', :submission_value => 'mV' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'ng/dL', :synonyms => 'Nanogram per Deciliter', :definition => 'A unit of mass concentration defined as the concentration of one nanogram of a substance in unit volume of the mixture equal to one deciliter. The concept also refers to the unit of mass density (volumic mass) defined as the density of substance which mass equal to one nanogram occupies the volume one deciliter.(NCI)', :code => 'C67326', :nci_preferred_term => 'Nanogram per Deciliter', :read_only => 'true', :id => '2096', :submission_value => 'ng/dL' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'ug/m3', :synonyms => 'Microgram per Cubic Meter; mcg/m3', :definition => 'A unit of mass concentration defined as the concentration of one nanogram of a substance per one liter of the mixture, or one picogram of a substance in unit volume of the mixture equal to one milliliter, or one microgram of a substance per one cubic meter of the mixture. The concept also refers to the metric unit of mass density (volumic mass) defined as the density of substance which mass equal to one nanogram occupies the volume one liter.(NCI)', :code => 'C67327', :nci_preferred_term => 'Nanogram per Liter', :read_only => 'true', :id => '2097', :submission_value => 'ug/m3' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'nm', :synonyms => 'Nanometer', :definition => 'A unit of length equal to one billionth of a meter (10E-9 meter). Nanometer is used as a unit for light wavelength measurement.(NCI)', :code => 'C67328', :nci_preferred_term => 'Nanometer', :read_only => 'true', :id => '2098', :submission_value => 'nm' },
