  { :sdtm_category_id => '41', :cdisc_preferred_term => 'psi', :synonyms => 'Pounds per Square Inch', :definition => 'A unit of pressure equivalent to 6.894757 kilopascals, or 703.0696 kilograms per square meter, or 51.71507 millimeters of mercury.(NCI)', :code => 'C67334', :nci_preferred_term => 'Pound per Square Inch', :read_only => 'true', :id => '2100', :submission_value => 'psi' },
