  { :sdtm_category_id => '41', :cdisc_preferred_term => 'L/min', :synonyms => 'Liters per Minute', :definition => 'A unit of volumetric flow rate defined as the rate at which one liter of matter travels during the period of time equal to one minute.(NCI)', :code => 'C67388', :nci_preferred_term => 'Liter per Minute', :read_only => 'true', :id => '2107', :submission_value => 'L/min' },
  { :sdtm_category_id => '41', :cdisc_preferred_term => 'ug/h', :synonyms => 'Micrograms per Hour; mcg/h', :definition => 'A unit of mass flow rate equivalent to the rate at which one millionth of a gram of matter travels to a given object or space over a period of time equal to one hour.(NCI)', :code => 'C67394', :nci_preferred_term => 'Microgram per Hour', :read_only => 'true', :id => '2108', :submission_value => 'ug/h' },
