  { :sdtm_category_id => '41', :cdisc_preferred_term => 'ukat/L', :synonyms => 'Microkatal per Liter; mckat/L', :definition => 'Unit of catalytic activity concentration defined as activity equal to one millionth of katal per one liter of the system volume.(NCI)', :code => 'C67397', :nci_preferred_term => 'Microkatal per Liter', :read_only => 'true', :id => '2110', :submission_value => 'ukat/L' },
