  { :sdtm_category_id => '42', :cdisc_preferred_term => 'GALLBLADDER', :synonyms => 'Gallbladder', :definition => 'A pear-shaped organ located under the liver that stores and concentrates bile secreted by the liver. From the gallbladder the bile is delivered through the bile ducts into the intestine thereby aiding the digestion of fat-containing foods. (NCI)', :code => 'C12377', :nci_preferred_term => 'Gallbladder', :read_only => 'true', :id => '2284', :submission_value => 'GALLBLADDER' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'GASTROINTESTINAL SYSTEM', :synonyms => 'Gastrointestinal System', :definition => 'The system that includes the esophagus, stomach, small and large intestine, anus, liver, biliary tract, and pancreas. (NCI)', :code => 'C12378', :nci_preferred_term => 'Gastrointestinal System', :read_only => 'true', :id => '2285', :submission_value => 'GASTROINTESTINAL SYSTEM' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'LARGE INTESTINE', :synonyms => 'Large Intestine', :definition => 'A muscular tube that extends from the end of the small intestine to the anus. (NCI)', :code => 'C12379', :nci_preferred_term => 'Large Intestine', :read_only => 'true', :id => '2286', :submission_value => 'LARGE INTESTINE' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'APPENDIX', :synonyms => 'Appendix', :definition => 'Small tissue projection existing as a cecal diverticulum with a questionable history of vestigial versus specialized organ. (NCI)', :code => 'C12380', :nci_preferred_term => 'Appendix', :read_only => 'true', :id => '2287', :submission_value => 'APPENDIX' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'COLON', :synonyms => 'Colon', :definition => 'The part of the large intestine measured from the cecum to the rectum consisting of ascending, transverse, descending and sigmoid portions. The purpose of the colon is to remove water from digested food prior to excretion. (NCI)', :code => 'C12382', :nci_preferred_term => 'Colon', :read_only => 'true', :id => '2288', :submission_value => 'COLON' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'SMALL INTESTINE', :synonyms => 'Small Intestine', :definition => 'The section of the intestines between the pylorus and cecum. The small intestine is approximately 20 feet long and consists of the duodenum, the jejunum, and the ileum. Its main function is to absorb nutrients from food as the food is transported to the large intestine. (NCI)', :code => 'C12386', :nci_preferred_term => 'Small Intestine', :read_only => 'true', :id => '2289', :submission_value => 'SMALL INTESTINE' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'ILEUM', :synonyms => 'Ileum', :definition => 'The final section of the small intestine. (NCI)', :code => 'C12387', :nci_preferred_term => 'Ileum', :read_only => 'true', :id => '2290', :submission_value => 'ILEUM' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'JEJUNUM', :synonyms => 'Jejunum', :definition => 'The portion of the small intestine that extends from the duodenum to the ileum. (NCI)', :code => 'C12388', :nci_preferred_term => 'Jejunum', :read_only => 'true', :id => '2291', :submission_value => 'JEJUNUM' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'ESOPHAGUS', :synonyms => 'Esophagus', :definition => 'The portion of the digestive canal between the pharynx and stomach. It is about 25 cm long and consists of three parts: the cervical part, from the cricoid cartilage to the thoracic inlet; thoracic part, from thoracic inlet to the diaphragm; and abdominal part, below the diaphragm to the cardiac opening of the stomach. (NCI)', :code => 'C12389', :nci_preferred_term => 'Esophagus', :read_only => 'true', :id => '2292', :submission_value => 'ESOPHAGUS' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'STOMACH', :synonyms => 'Stomach', :definition => 'An organ located under the diaphragm, between the liver and the spleen as well as between the esophagus and the small intestine. The stomach is the primary organ of food digestion. (NCI)', :code => 'C12391', :nci_preferred_term => 'Stomach', :read_only => 'true', :id => '2293', :submission_value => 'STOMACH' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'LIVER', :synonyms => 'Liver', :definition => 'A triangular-shaped organ located under the diaphragm in the right hypochondrium. It is the largest internal organ of the body, weighting up to 2 kg. Metabolism and bile secretion are its main functions. It is composed of cells which have the ability to regenerate. (NCI)', :code => 'C12392', :nci_preferred_term => 'Liver', :read_only => 'true', :id => '2294', :submission_value => 'LIVER' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'PANCREAS', :synonyms => 'Pancreas', :definition => 'An organ behind the lower part of the stomach that is the shape of a fish and about the size of a hand. It is a compound gland composed of both exocrine and endocrine tissues. The endocrine pancreas makes insulin so that the body can use glucose (sugar) for energy. The exocrine pancreas makes enzymes that help the body digest food. Spread all over the pancreas are areas called the Islets of Langerhans. The cells in these areas each have a special purpose. The alpha cells make glucagon, which raises the level of glucose in the blood; the beta cells make insulin; the delta cells make somatostatin. There are also PP cells and D1 cells, about which little is known. (NCI)', :code => 'C12393', :nci_preferred_term => 'Pancreas', :read_only => 'true', :id => '2295', :submission_value => 'PANCREAS' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'EAR', :synonyms => 'Ear', :definition => 'A sense organ needed for the detection of sound and for establishing balance. The outer ear consists of the auricle, the ear canal as well as the tympanic membrane. The middle ear is made up of an air-filled cavity behind the tympanic membrane that contains the ossicles (malleus, incus and stapes). The inner ear is made up of the cochlea needed for hearing and the vestibular apparatus required for balance. (NCI)', :code => 'C12394', :nci_preferred_term => 'Ear', :read_only => 'true', :id => '2296', :submission_value => 'EAR' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'THYROID GLAND', :synonyms => 'Thyroid Gland', :definition => 'An endocrine gland located at the base of the neck that produces and secretes thyroxine and other hormones. Thyroxine is important for metabolic control. (NCI)', :code => 'C12400', :nci_preferred_term => 'Thyroid Gland', :read_only => 'true', :id => '2297', :submission_value => 'THYROID GLAND' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'EYE', :synonyms => 'Eye', :definition => 'The organ of sight or vision. (NCI)', :code => 'C12401', :nci_preferred_term => 'Eye', :read_only => 'true', :id => '2298', :submission_value => 'EYE' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'FALLOPIAN TUBE', :synonyms => 'Fallopian Tube', :definition => 'One of a pair of tubes that extend from the uterus to each of the ovaries. Following ovulation the egg travels down the fallopian tube to the uterus where fertilization may or may not occur. (NCI)', :code => 'C12403', :nci_preferred_term => 'Fallopian Tube', :read_only => 'true', :id => '2299', :submission_value => 'FALLOPIAN TUBE' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'OVARY', :synonyms => 'Ovary', :definition => 'One of the paired female reproductive glands containing the ova or germ cells; the ovary\'s stroma is a vascular connective tissue containing numbers of ovarian follicles enclosing the ova. (NCI)', :code => 'C12404', :nci_preferred_term => 'Ovary', :read_only => 'true', :id => '2300', :submission_value => 'OVARY' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'UTERUS', :synonyms => 'Uterus', :definition => 'A hollow, thick-walled, muscular organ located within the pelvic cavity of a woman. Within the uterus the fertilized egg implants and the fetus develops during pregnancy. (NCI)', :code => 'C12405', :nci_preferred_term => 'Uterus', :read_only => 'true', :id => '2301', :submission_value => 'UTERUS' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'VAGINA', :synonyms => 'Vagina', :definition => 'The female genital canal, extending from the uterus to the vulva. (NCI)', :code => 'C12407', :nci_preferred_term => 'Vagina', :read_only => 'true', :id => '2302', :submission_value => 'VAGINA' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'VULVA', :synonyms => 'Vulva', :definition => 'The external, visible part of the female genitalia surrounding the urethral and vaginal opening. The vulva includes the clitoris and inner as well as outer labia. (NCI)', :code => 'C12408', :nci_preferred_term => 'Vulva', :read_only => 'true', :id => '2303', :submission_value => 'VULVA' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'PENIS', :synonyms => 'Penis', :definition => 'The male organ of urination and copulation. (NCI)', :code => 'C12409', :nci_preferred_term => 'Penis', :read_only => 'true', :id => '2304', :submission_value => 'PENIS' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'PROSTATE GLAND', :synonyms => 'Prostate Gland', :definition => 'The walnut shaped accessory sex gland of the male reproductive system. It is located in the pelvis just below the bladder, surrounding the prostatic part of the urethra. The prostate gland secretes a fluid which is part of the semen. (NCI)', :code => 'C12410', :nci_preferred_term => 'Prostate Gland', :read_only => 'true', :id => '2305', :submission_value => 'PROSTATE GLAND' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'TESTIS', :synonyms => 'Testis', :definition => 'Either of the paired male reproductive glands that produce the male germ cells and the male hormones. (NCI)', :code => 'C12412', :nci_preferred_term => 'Testis', :read_only => 'true', :id => '2306', :submission_value => 'TESTIS' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'URINARY SYSTEM', :synonyms => 'Urinary System', :definition => 'The organs involved in the creation and excretion of urine. (NCI)', :code => 'C12413', :nci_preferred_term => 'Urinary System', :read_only => 'true', :id => '2307', :submission_value => 'URINARY SYSTEM' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'BLADDER', :synonyms => 'Bladder', :definition => 'The distensible sac-like organ that functions as a reservoir of urine, collecting from the kidneys and eliminating via the urethra. (NCI)', :code => 'C12414', :nci_preferred_term => 'Bladder', :read_only => 'true', :id => '2308', :submission_value => 'BLADDER' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'KIDNEY', :synonyms => 'Kidney', :definition => 'One of the two bean-shaped organs located on each side of the spine in the retroperitoneum. The right kidney is located below the liver and the left kidney below the diaphragm. The kidneys filter and secret the metabolic products and minerals from the blood, thus maintaining the homeostasis. On the superior pole of each kidney there is an adrenal gland. Each kidney and adrenal gland is surrounded by fat. (NCI)', :code => 'C12415', :nci_preferred_term => 'Kidney', :read_only => 'true', :id => '2309', :submission_value => 'KIDNEY' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'URETER', :synonyms => 'Ureter', :definition => 'The thick-walled tube that carries urine from each kidney to the bladder. (NCI)', :code => 'C12416', :nci_preferred_term => 'Ureter', :read_only => 'true', :id => '2310', :submission_value => 'URETER' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'URETHRA', :synonyms => 'Urethra', :definition => 'The tube carrying urine from the bladder to outside of the body. (NCI)', :code => 'C12417', :nci_preferred_term => 'Urethra', :read_only => 'true', :id => '2311', :submission_value => 'URETHRA' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'HEAD', :synonyms => 'Head', :definition => 'The anterior and superior part of a human or animal bearing the mouth, the brain and sensory organs.', :code => 'C12419', :nci_preferred_term => 'Head', :read_only => 'true', :id => '2312', :submission_value => 'HEAD' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'LARYNX', :synonyms => 'Larynx', :definition => 'The cartilaginous structure of the respiratory tract between the pharynx and the trachea. It contains elastic vocal cords required for sound production. (NCI)', :code => 'C12420', :nci_preferred_term => 'Larynx', :read_only => 'true', :id => '2313', :submission_value => 'LARYNX' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'ORAL CAVITY', :synonyms => 'Oral Cavity', :definition => 'The cavity located at the upper end of the alimentary canal, behind the teeth and gums that is bounded on the outside by the lips, above by the hard and soft palates and below by the tongue. (NCI)', :code => 'C12421', :nci_preferred_term => 'Oral Cavity', :read_only => 'true', :id => '2314', :submission_value => 'ORAL CAVITY' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'TONGUE', :synonyms => 'Tongue', :definition => 'The muscular organ located in the floor of the mouth and serving as the principal organ of taste and modification of the voice in speech. (NCI)', :code => 'C12422', :nci_preferred_term => 'Tongue', :read_only => 'true', :id => '2315', :submission_value => 'TONGUE' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'NASOPHARYNX', :synonyms => 'Nasopharynx', :definition => 'The part of the pharynx in the back of the throat, at and above the soft palate. The nasopharynx is continuous with the nasal passages. (NCI)', :code => 'C12423', :nci_preferred_term => 'Nasopharynx', :read_only => 'true', :id => '2316', :submission_value => 'NASOPHARYNX' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'NASAL CAVITY', :synonyms => 'Nasal Cavity', :definition => 'The proximal portion of the respiratory passages on either side of the nasal septum lying between the floor of the cranium and the roof of the mouth and extending from the face to the pharynx. The nasal cavity is lined with ciliated mucosa, extending from the nares to the pharynx. (NCI)', :code => 'C12424', :nci_preferred_term => 'Nasal Cavity', :read_only => 'true', :id => '2317', :submission_value => 'NASAL CAVITY' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'PHARYNX', :synonyms => 'Pharynx', :definition => 'A hollow tube that starts posterior to the mouth and nasal cavity and ends superior to the trachea and esophagus. (NCI)', :code => 'C12425', :nci_preferred_term => 'Pharynx', :read_only => 'true', :id => '2318', :submission_value => 'PHARYNX' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'PAROTID GLAND', :synonyms => 'Parotid Gland', :definition => 'The largest of the three paired salivary glands, located in front of the ear. (NCI)', :code => 'C12427', :nci_preferred_term => 'Parotid Gland', :read_only => 'true', :id => '2319', :submission_value => 'PAROTID GLAND' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'TRACHEA', :synonyms => 'Trachea', :definition => 'The fibrocartilaginous, mucous-lined tube passing from the larynx to the bronchi. (NCI)', :code => 'C12428', :nci_preferred_term => 'Trachea', :read_only => 'true', :id => '2320', :submission_value => 'TRACHEA' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'LIMB', :synonyms => 'Limb', :definition => 'A body region referring to an upper or lower extremity. (NCI)', :code => 'C12429', :nci_preferred_term => 'Limb', :read_only => 'true', :id => '2321', :submission_value => 'LIMB' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'SPLEEN', :synonyms => 'Spleen', :definition => 'An organ that is part of the hematopoietic and immune systems. It is composed of the white pulp and the red pulp and is surrounded by a capsule. It is located in the left hypochondriac region. Its functions include lymphocyte production, blood cell storage, and blood cell destruction. (NCI)', :code => 'C12432', :nci_preferred_term => 'Spleen', :read_only => 'true', :id => '2322', :submission_value => 'SPLEEN' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'THYMUS GLAND', :synonyms => 'Thymus Gland', :definition => 'A bi-lobed organ surrounded by a connective tissue capsule. It is located in the upper anterior portion of the chest, behind the sternum. It is composed predominantly of lymphocytes and fewer epithelial cells. Connective tissue septa separate the lobes into lobules. The lobules contain an outer portion (cortical zone) which is rich in lymphocytes and an inner portion (medullary zone) which is rich in epithelial cells. It is an organ essential for the development of the immune system. Its function is the maturation of the progenitor lymphoid cells to thymocytes and subsequently to mature T-cells. It reaches its greatest weight at puberty and subsequently begins to involute. (NCI)', :code => 'C12433', :nci_preferred_term => 'Thymus Gland', :read_only => 'true', :id => '2323', :submission_value => 'THYMUS GLAND' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'BLOOD', :synonyms => 'Blood', :definition => 'A liquid tissue; its major function is to transport oxygen throughout the body. It also supplies the tissues with nutrients, removes waste products, and contains various components of the immune system defending the body against infection. Several hormones also travel in the blood. (NCI)', :code => 'C12434', :nci_preferred_term => 'Blood', :read_only => 'true', :id => '2324', :submission_value => 'BLOOD' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'MUSCLE TISSUE', :synonyms => 'Muscle Tissue', :definition => 'Tissue responsible for the body movements and the shape and size changes of interna organs. Muscle tissue is composed of specialized contractile cells. There are two types of muscle tissue recognized: striated and smooth muscle. The striated muscle tissue is further subdivided into skeletal, visceral striated, and cardiac muscle. (NCI)', :code => 'C12435', :nci_preferred_term => 'Muscle Tissue', :read_only => 'true', :id => '2325', :submission_value => 'MUSCLE TISSUE' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'BRAIN', :synonyms => 'Brain', :definition => 'An organ composed of grey and white matter containing billions of neurons that is the center for intelligence and reasoning. It is protected by the bony cranium. (NCI)', :code => 'C12439', :nci_preferred_term => 'Brain', :read_only => 'true', :id => '2326', :submission_value => 'BRAIN' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'MEDULLA OBLONGATA', :synonyms => 'Medulla Oblongata', :definition => 'The lower portion of the brainstem located between the pons and brainstem. This structure contains several descending and ascending tracts, lower cranial nerve nuclei, a significant proportion of the reticular system of the brainstem and other structures. (NCI)', :code => 'C12442', :nci_preferred_term => 'Medulla Oblongata', :read_only => 'true', :id => '2327', :submission_value => 'MEDULLA OBLONGATA' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'BASAL GANGLIA', :synonyms => 'Basal Ganglia', :definition => 'Clusters of neurons comprising the globus pallidus, putamen, caudate, nucleus accumbens, substantia nigra and subthalamic nucleus. They are involved with high level aspects of inhibitory motor activity in coordination with the excitation commands issued from the cerebellum. (NCI)', :code => 'C12447', :nci_preferred_term => 'Basal Ganglia', :read_only => 'true', :id => '2328', :submission_value => 'BASAL GANGLIA' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'PUTAMEN', :synonyms => 'Putamen', :definition => 'The largest and most lateral of the basal ganglia lying between the lateral medullary lamina of the globus pallidus and the external capsule. It is part of the neostriatum and forms part of the lentiform nucleus along with the globus pallidus. (MeSH) (NCI)', :code => 'C12452', :nci_preferred_term => 'Putamen', :read_only => 'true', :id => '2329', :submission_value => 'PUTAMEN' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'THALAMUS', :synonyms => 'Thalamus', :definition => 'An ovoid mass composed predominantly of gray substance and associated laminae of white substance. The thalamus is divided into anterior, medial, and lateral parts. The function of the thalamus is to relay sensory impulses and cerebellar and basal ganglia projections to the cerebral cortex. The thalamus is positioned within the posterior part of the diencephalon forming most of each lateral wall of the third ventricle. (NCI)', :code => 'C12459', :nci_preferred_term => 'Thalamus', :read_only => 'true', :id => '2330', :submission_value => 'THALAMUS' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'LUNG', :synonyms => 'Lung', :definition => 'One of a pair of viscera occupying the pulmonary cavities of the thorax, the organs of respiration in which aeration of the blood takes place. As a rule, the right lung is slightly larger than the left and is divided into three lobes (an upper, a middle, and a lower or basal), while the left has two lobes (an upper and a lower or basal). Each lung is irregularly conical in shape, presenting a blunt upper extremity (the apex), a concave base following the curve of the diaphragm, an outer convex surface (costal surface), an inner or mediastinal surface (mediastinal surface), a thin and sharp anterior border, and a thick and rounded posterior border. (NCI)', :code => 'C12468', :nci_preferred_term => 'Lung', :read_only => 'true', :id => '2331', :submission_value => 'LUNG' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'SKIN', :synonyms => 'Skin', :definition => 'An organ that constitutes the external surface of the body. It consists of the epidermis, dermis, and skin appendages. (NCI)', :code => 'C12470', :nci_preferred_term => 'Skin', :read_only => 'true', :id => '2332', :submission_value => 'SKIN' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'TYMPANIC MEMBRANE', :synonyms => 'Tympanic Membrane', :definition => 'A thin membrane that separates the external auditory canal from the middle ear. The movement of the tympanic membrane in response to air pressure changes in the external ear facilitates the transmission of sound energy by causing vibration of the ossicular chain. (NCI)', :code => 'C12502', :nci_preferred_term => 'Tympanic Membrane', :read_only => 'true', :id => '2333', :submission_value => 'TYMPANIC MEMBRANE' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'MASTOID PROCESS', :synonyms => 'Mastoid Process', :definition => 'A honeycombed section of bone located near the base of the skull, protruding behind the outer ear. It is connected to the middle ear. (NCI)', :code => 'C12503', :nci_preferred_term => 'Mastoid Process', :read_only => 'true', :id => '2334', :submission_value => 'MASTOID PROCESS' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'ABDOMINAL CAVITY', :synonyms => 'Abdominal Cavity', :definition => 'The portion of the body that lies between the thorax and the pelvis. (NCI)', :code => 'C12664', :nci_preferred_term => 'Abdominal Cavity', :read_only => 'true', :id => '2335', :submission_value => 'ABDOMINAL CAVITY' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'ADRENAL GLAND', :synonyms => 'Adrenal Gland', :definition => 'Suprarenal gland. A flattened, roughly triangular body resting upon the upper end of each kidney; it is one of the ductless glands furnishing internal secretions (epinephrine and norepinephrine from the medulla and steroid hormones from the cortex). (NCI)', :code => 'C12666', :nci_preferred_term => 'Adrenal Gland', :read_only => 'true', :id => '2336', :submission_value => 'ADRENAL GLAND' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'AORTA', :synonyms => 'Aorta', :definition => 'The major arterial trunk that carries oxygenated blood from the left ventricle into the ascending aorta behind the heart, the aortic arch, through the thorax as the descending aorta and through the abdomen as the abdominal aorta; it bifurcates into the left and right common iliac arteries. (NCI)', :code => 'C12669', :nci_preferred_term => 'Aorta', :read_only => 'true', :id => '2337', :submission_value => 'AORTA' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'AXILLA', :synonyms => 'Axilla', :definition => 'The underside concavity where the arm and the shoulder are joined. (NCI)', :code => 'C12674', :nci_preferred_term => 'Axilla', :read_only => 'true', :id => '2338', :submission_value => 'AXILLA' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'BILIARY TRACT', :synonyms => 'Biliary Tract', :definition => 'The duct system that transports bile from its origination by hepatocytes in the liver to the small intestine. It is comprised of the common bile duct that connects the liver and gall bladder to the small intestine and the cystic duct that connects the gall bladder to the common bile duct. (NCI)', :code => 'C12678', :nci_preferred_term => 'Biliary Tract', :read_only => 'true', :id => '2339', :submission_value => 'BILIARY TRACT' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'BLOOD VESSEL', :synonyms => 'Blood Vessel', :definition => 'A tubular structure through which the blood circulates in the body. Blood vessels constitute a network composed of arteries, arterioles, capillaries, venules, and veins. (NCI)', :code => 'C12679', :nci_preferred_term => 'Blood Vessel', :read_only => 'true', :id => '2340', :submission_value => 'BLOOD VESSEL' },
  { :sdtm_category_id => '42', :cdisc_preferred_term => 'BRACHIAL ARTERY', :synonyms => 'Brachial Artery', :definition => 'An artery originating at the axillary artery and branching into the radial and ulnar arteries. (NCI)', :code => 'C12681', :nci_preferred_term => 'Brachial Artery', :read_only => 'true', :id => '2341', :submission_value => 'BRACHIAL ARTERY' },
